var kai_def =['《說文》：“丄，高也。此古文上，指事也。上，篆文丄。”', '《說文》：“中，內也。从口、丨，上下通。𠁧，古文中。𠁩，籀文中。”', '《說文》：“小，物之微也。从八，丨見而分之。”', '《說文》：“咊，相譍也。从口，禾聲。”', '《說文》：“是，直也。从日、正。昰，籀文是，从古文正。”', '《說文》：“道，所行道也。从辵，从𩠐。一達謂之道。𡬹，古文道从𩠐、寸。”', '《說文》：“得，行有所得也。从彳，㝵聲。䙷，古文省彳。”', '《說文》：“十，數之具也。一為東西，丨為南北，則四方中央備矣。”', '《說文》：“說，說釋也。从言、兌。一曰談說。”', '《說文》：“要，身中也，象人要自𦥑之形。从𦥑，交省聲。”', '《說文》：“可，肎也。从口、丂，丂亦聲。”', '《說文》：“㒰，完也。从入，从工。全，篆文㒰从玉。純玉曰全。𠌆，古文仝。”', '《說文》：“就，就高也。从京，从尤。尤，異於凡也。𡰗，籀文就。”', '《說文》：“來，周所受瑞麥來麰，一來二縫。象芒朿之形。天所來也，故為行來之來。”', '《說文》：“生，進也。象艸木生出土上。”', '《說文》：“國，邦也。从囗，从或。”', '《說文》：“𨙻，西夷國。从邑，冄聲。安定有朝𨙻縣。”', '《說文》：“時，四時也。从日，寺聲。旹，古文時，从之、日。”', '《說文》：“有，不宜有也。《春秋傳》曰：‘日月有食之。’从月，又聲。”', '《說文》：“家，居也。从宀，豭省聲。”', '《說文》：“人，天地之性最貴者也。此籀文，象臂脛之形。”', '《說文》：“大，天大、地大、人亦大，故大象人形。”', '《說文》：“不，鳥飛上翔不下來也。从一，一猶天也。象形。”', '《說文》：“到，至也。从至，刀聲。”', '《說文》：“也，女陰也。象形。𠃟，秦刻石也字。”', '《說文》：“我，施身自謂也。或說我，頃頓也。从戈，从𠄒。𠄒，或說古垂字。一曰古殺字。𢦠，古文我。”', '《說文》：“二，地之數也。从偶一。弍，古文。”', '《說文》：“在，存也。从土，才聲。”', '《說文》：“子，十一月陽气動，萬物滋，人以為偁。象形。㜽，古文子，从巛，象髮也。𢀈，籀文子，囟有髮，臂、脛在几上也。”', '《說文》：“了，尦也。从子無臂，象形。”', '《說文》：“㠯，用也。从反已。賈侍中說，已，意已實也。象形。”', '《說文》：“天，顛也。至高无上，从一、大。”', '《說文》：“丅，底也。指事。下，篆文丅。”', '《說文》：“三，天地人之道也。从三數。弎，古文三从弋。”', '《說文》：“起，能立也。从走，巳聲。𢀽，古文起，从辵。”', '《說文》：“過，度也。从辵，咼聲。”', '《說文》：“後，遲也。从彳幺夊者，後也。𨒥，古文後从辵。”', '《說文》：“很，不聽从也。一曰行難也。一曰盭也。从彳，𥃩聲。”', '《說文》：“爲，母猴也，其爲禽好爪，爪，母猴象也；下腹為母猴形。王育曰：‘爪，象形也。’𦥮，古文爲，象兩母猴相對形。”', '《說文》：“又，手也，象形。三指者，手之列多略不過三也。”', '《說文》：“事，職也。从史，之省聲。𡷮，古文事。”', '《說文》：“斆，覺悟也。从教，从冖，冖，尚矇也，臼聲。學，篆文斅省。”', '《說文》：“用，可施行也。从卜，从中。衛宏說。𤰆，古文用。”', '《說文》：“看，睎也。从手下目。𥉏，看或从倝。”', '《說文》：“自，鼻也。象鼻形。𦣼，古文自。”', '《說文》：“麼，細也，从幺麻聲。”', '《說文》：“去，人相違也。从大，凵聲。”', '《說文》：“會，合也。从亼，从曾省。曾，益也。，古文會如此。”', '《說文》：“樣，栩實。从木，羕聲。”', '《說文》：“本，木下曰本。从木，一在其下。楍，古文。”', '《說文》：“之，出也。象艸過屮，枝莖益大有所之。一者，地也。”', '《說文》：“出，進也。象艸木益滋上出達也。”', '《說文》：“都，有先君之舊宗廟曰都。从邑，者聲。《周禮》距國五百里為都。”', '《說文》：“日，實也，太陽之精不虧。从囗、一，象形。，古文，象形。”', '《說文》：“多，重也。从重夕。夕者，相繹也，故為多。重夕為多，重日為㬪。𡖇，古文多。”', '《說文》：“種，先穜後孰也。从禾，重聲。”', '《說文》：“年，穀孰也。从禾，千聲。”', '《說文》：“什，相什保也。从人、十。”', '《說文》：“方，併船也。象兩舟省緫頭形。汸，方或从水。”', '《說文》：“兒，孺子也。从儿，象小兒頭囟未合。”', '《說文》：“見，視也。从儿，从目。”', '《說文》：“面，顏前也。从𦣻，象人面形。”', '《說文》：“能，熊屬，足似鹿。从肉，㠯聲。能獸堅中，故稱賢能，而彊壯稱能傑也。”', '《說文》：“沒，沈也。从水，从𠬸。”', '《說文》：“把，握也。从手，把聲。”', '《說文》：“好，美也。从女、子。”', '《說文》：“地，元气初分，輕、清、陽為天；重、濁、陰為地。萬物所陳列也。从土，也聲。墬，籀文地从䧘。”', '《說文》：“所，伐木聲也。从斤，戶聲。”', '《說文》：“四，陰數也。象四分之形。𦉭，古文四。亖，籀文四。”', '《說文》：“五，五行也。从二。陰陽在天地間交午也。㐅，古文五省。”', '《說文》：“八，別也。象分別相背之形。”', '《說文》：“分，別也。从八，从刀，刀以分別物也。”', '《說文》：“問，訊也。从口，門聲。”', '《說文》：“叫，嘑也。从口，丩聲。”', '《說文》：“歬，不行而進謂之歬。从止在舟上。”', '《說文》：“還，復也。从辵，睘聲。”', '《說文》：“行，人之步趨也。从彳，从亍。”', '《說文》：“䛡，合會善言也。从言，𠯑聲。《傳》曰：‘告之話言。’譮，籀文䛡从會。”', '《說文》：“𡭊，譍無方也。从丵，从口，从寸。對，或从土。”', '《說文》：“教，上所施下所效也。从攴，从𡥉。𧧿，古文教；𤕝，亦古文教。”', '《說文》：“烏，孝鳥也。象形。孔子曰：‘烏，𥃳呼也。’取其助气，故以為烏呼。𤚶，古文烏，象形。於，象古文烏省。”', '《說文》：“等，齊簡也。从竹，从寺。寺，官曹之等平也。”', '《說文》：“工，巧飾也。象人有規榘也。與巫同意。𢀚，古文工从彡。”', '《說文》：“知，詞也。从口，从矢。”', '《說文》：“校，木囚也。从木，交聲。”', '《說文》：“因，就也。从囗、大。”', '《說文》：“朙，照也。从月，从囧。明，古文朙，从日。”', '《說文》：“外，遠也。卜尚平旦，今夕卜，於事外矣。𡖄，古文外。”', '《說文》：“同，合會也。从𠔼，从口。”', '《說文》：“兩，二十四銖為一兩。从一；㒳，平分，亦聲。”', '《說文》：“作，起也。从人，从乍。”', '《說文》：“便，安也。人有不便，更之。从人、更。”', '《說文》：“從，隨行也。从辵，从从，从亦聲。”', '《說文》：“老，考也。七十曰老。从人、毛、匕。言須髮變白也。”', '《說文》：“頭，首也。从頁，豆聲。”', '《說文》：“長，久遠也。从兀，从匕。兀者，高遠意也。久則變化。亾聲。●者倒亾也。𠑷，古文長；𨱗，亦古文長。”', '《說文》：“灋，刑也。平之如水，从水；廌，所以觸不直者，去之，从去。法，今文省。佱，古文。”', '《說文》：“然，燒也。从火，肰聲。䕼，或从艸、難。”', '《說文》：“心，人心。土藏，在身之中。象形。博士說以為火藏。”', '《說文》：“想，冀思也。从心，相聲。”', '《說文》：“水，準也。北方之行。象眾水並流，中有微陽之气也。”', '《說文》：“西，鳥在巢上，象形。日在西方而鳥棲，故因以為東西之西。”', '《說文》：“如，从隨也。从女，从口。”', '《說文》：“民，眾萌也。从古文之象。”', '《說文》：“發，䠶發也。从弓，癹聲。”', '《說文》：“經，織也。从糸，巠聲。”', '《說文》：“動，作也。从力，重聲。𨔝，古文動从辵。”', '《說文》：“成，就也。从戊，丁聲。𢦩，古文成从午。”', '《說文》：“公，平分也。从八、从厶。八，猶背也。韓非曰：‘背厶為公’。”', '《說文》：“物，萬物也。牛為大物，天地之數，起於牽牛，故从牛，勿聲。”', '《說文》：“名，自命也。从口，从夕。夕者，冥也。冥不相見，故以口自名。”', '《說文》：“吃，言蹇難也。从口，气聲。”', '《說文》：“各，異辭也。从口、夂。夂者，有行而止之，不相聽也。”', '《說文》：“走，趨也。从夭、止，夭止者，屈也。”', '《說文》：“此，止也。从止，从匕。匕，相比次也。”', '《說文新附》：“些，語辭也，見《楚辭》。从此，从二。其義未詳。”', '《說文》：“進，登也。从辵，閵省聲。”', '《說文》：“只，語已詞也。从口，象氣下引之形。”', '《說文》：“幾，微也，殆也。从𢆶，从戍。戍，兵守也。𢆶而兵守者危也。”', '《說文》：“主，鐙中火主也。从，象形；从丶，丶亦聲。”', '《說文》：“今，是時也。从亼，从乁。乁，古文及。”', '《說文》：“高，崇也，象臺觀高之形。从冂、口，與倉舍同意。”', '《說文》：“東，動也。从木。官溥說，从日在木中。”', '《說文》：“𣞤，豐也。从林、𡘲。或說規模字。从大；𠦜，數之積也；林者，木之多也。𠦜與庶同意。《商書》曰：｀庶草繁無’。”', '《說文》：“回，轉也。从囗，中象回轉形。囘，古文。”', '《說文》：“月，闕也，大陰之精，象形。”', '《說文》：“定，安也。从宀，从正。”', '《說文》：“最，犯而取也。从冃，从取。”', '《說文》：“常，下帬也。从巾，尚聲。裳，常或从衣。”', '《說文》：“白，西方色也。陰用事，物色白。从入合二。二，陰數。𦣺，古文白。”', '《說文》：“𠊱，伺望也。从人，矦聲。”', '《說文》：“但，裼也。从人，旦聲。”', '《說文》：“先，前進也。从儿，从之。”', '《說文》：“山，宣也。宣气𢿱，生萬物，有石而高。象形。”', '《說文》：“而，頰毛也。象毛之形。《周禮》曰：‘作其鱗之而。’”', '《說文》：“意，志也。从心察言而知意也。从心，从音。”', '《說文》：“應，當也。从心，𨿳聲。”', '《說文》：“開，張也。从門，从幵。𨴉，古文開。”', '《說文》：“聽，聆也。从耳、𢛳，𡈼声。”', '《說文》：“手，拳也。象形。𠂿，古文手。”', '《說文》：“女，婦人也。象形。王育說。”', '《說文》：“給，相足也。从糸，合聲。”', '《說文》：“當，田相值也。从田，尚聲。”', '《說文》：“力，筋也。象人筋之形。治功曰力，能圉大災。”', '《說文》：“官，吏事君也。从宀，从𠂤。𠂤猶眾也，此與師同意。”', '《說文》：“六，《易》之數，陰變於六，正於八。从入，从八。”', '《說文》：“口，人所以言食也。象形。”', '《說文》：“正，是也。从止，一以止。㱏，古文正，从二，二，古上字。𣥔，古文正，从一、足，足者，亦止也。”', '《說文》：“路，道也。从足，从各。”', '《說文》：“將，帥也。从寸，𤖕省聲。”', '《說文》：“政，正也。从攴，从正，正亦聲。”', '《說文》：“相，省視也。从目，从木。《易》曰：‘地可觀者莫可觀於木。’《詩》曰：‘相鼠有皮。’”', '《說文》：“百，十十也。从一、白。數，十百為一貫，相章也。𦣻，古文百从自。”', '《說文》：“美，甘也。从羊，从大。”', '《說文》：“再，一舉而二也。从冓省。”', '《說文》：“箕，簸也。从竹；𠀠，象形；下其丌也。𠀠，古文箕省。𠔛，亦古文箕。𠔋，亦古文箕。，籀文箕。𠥊，籀文箕。”', '《說文》：“果，木實也。象果形在木之上。”', '《說文》：“師，二千五百人為師。从帀，从𠂤。𠂤，四帀眾意也。𠦵，古文師。”', '《說文》：“南，艸木至南方有枝任也。从𣎵，𢆉聲。𡴖，古文。”', '《說文》：“部，天水狄部。从邑，咅聲。”', '《說文》：“氣，饋客芻米也。从米，气聲。《春秋傳》曰：‘齊人來氣諸矦。’䊠，氣或从既；餼，氣或从食。”', '《說文》：“向，北出牖也。从宀，从口。”', '《說文》：“實，富也。从宀，从貫。貫，貨貝也。”', '《說文》：“位，列中庭之左右謂之位。从人、立。”', '《說文》：“使，伶也。从人，吏聲。”', '《說文》：“真，僊人變形而登天也。从𠤎，从目，从𠃊。八，所乘載也。𡙊，古文真。”', '《說文》：“北，𦮃也。从二人相背。”', '《說文》：“親，至也。从見，亲聲。”', '《說文》：“點，小黑也。从黑，占聲。”', '《說文》：“情，人之陰氣有欲者。从心，青聲。”', '《說文》：“快，喜也。从心，夬聲。”', '《說文》：“海，天池也，以納百川者。从水，每聲。”', '《說文》：“𣴠，水流聲。从水，𠯑聲。𣽅，𣴠或从𦕾。”', '《說文》：“泰，滑也。从廾，从水，大聲。夳，古文泰。”', '《說文》：“電，陰陽激燿也。从雨，从申。𩃿，古文電。”', '《說文》：“門，聞也。从二戶，象形。”', '《說文》：“聲，音也。从耳，殸聲。殸，籀文磬。”', '《說文新附》：“打，擊也。从手，丁聲。”', '《說文》：“母，牧也。从女，象褱子形。一曰象乳子也。”', '《說文》：“処，止也，得几而止。从几，从夂。處，処或从虍聲。”', '《說文》：“新，取木也。从斤，新聲。”', '《說文》：“七，陽之正也。从一，微陰从中衺出也。”', '《說文》：“九，陽之變也。象其屈曲究盡之形。”', '《說文》：“字，乳也。从子在宀下，子亦聲。”', '《說文》：“理，治玉也。从玉，里聲。”', '《說文》：“𡴋，艸盛上出也。从屮，母聲。”', '《說文》：“少，不多也。从小，丿聲。”', '《說文》：“咳，小兒笑也。从口，亥聲。孩，古文咳从子。”', '《說文》：“𨘢，行垂崖也。从辵，𦤝聲。”', '《說文》：“世，三十年為一世，从卉而曳長之，亦取其聲也。”', '《說文》：“請，謁也。从言，青聲。”', '《說文》：“許，聽也。从言，午聲。”', '《說文》：“業，大版也，所以飾縣鍾鼓，捷業如鋸齒，以白畫之，象其鉏鋙相承也。从丵，从巾，巾象版。《詩》曰：‘巨業維樅。’𤑽，古文業。”', '《說文》：“書，箸也。从聿，者聲。”', '《說文》：“放，逐也。从攴，方聲。”', '《說文》：“體，總十二屬也。从骨，豊聲。”', '《說文》：“利，銛也。从刀；和然後利，从和省。《易》曰：‘利者，義之和也。’”', '《說文》：“平，語平舒也。从亏，从八。八，分也。”', '《說文》：“合，合口也。从亼，从口。”', '《說文》：“入，內也。象从上俱下也。”', '《說文》：“內，入也。从口，自外而入也。”', '《說文》：“市，買賣所之也。市有垣，从冂，从乁。乁，古文及，象物相及也。之省聲。”', '《說文》：“機，主發謂之機。从木，幾聲。”', '《說文》：“圖，畫計難也。从口，从啚。啚，難意也。”', '《說文》：“安，靜也。从女在宀下。”', '《說文》：“像，象也。从人，从象，象亦聲。”', '《說文》：“重，厚也。从壬，東聲。”', '《說文》：“身，躳也。象人之身。从人，𠂆聲。”', '《說文》：“被，𡪢衣，長一身有半。从衣，皮聲。”', '《說文》：“次，不前不精也。从欠，二聲。𦮏，古文次。”', '《說文》：“文，錯畫也。象交文。”', '《說文》：“火，燬也。南方之行，炎而上，象形。”', '《說文》：“報，當罪人也。从㚔，从𠬝。𠬝，服罪也。”', '《說文》：“立，住也。从大，立一之上。”', '《說文》：“竝，併也。从二立。”', '《說文》：“𠫐，水泉本也。从灥出厂下。原，篆文从泉。”', '《說文》：“關，以木橫持門戶也。从門，𢇇聲。”', '《說文》：“或，邦也。从囗，从戈以守一。一，地也。域，或又从土。”', '《說文》：“總，聚束也。从糸，悤聲。”', '《說文》：“加，語相增加也。从力，从口。”', '《說文》：“車，輿輪之總名。夏后時奚仲所造。象形。𨏖，籀文車。”', '《說文》：“軍，圜圍也。四千人為軍。从車，从包省。軍，兵車也。”', '《說文》：“王，天下所歸往也。董仲舒曰：‘古之造文者，三畫而連其中謂之王。三者，天、地、人也；而參通之者，王也。’孔子曰：‘一貫三為王。’𠙺，古文王。”', '《說文》：“必，分極也。从八、弋，弋亦聲。”', '《說文》：“通，達也。从辵，甬聲。”', '《說文》：“信，誠也。从人，从言，會意。㐰，古文从言省。訃，古文信。”', '《說文》：“課，試也。从言，果聲。”', '《說文》：“共，同也。从廿、廾。𦱹，古文共。”', '《說文》：“與，黨與也。从舁，从与。𢌱，古文與。”', '《說文》：“父，矩也，家長率教者。从又舉杖。”', '《說文》：“故，使為之也。从攴，古聲。”', '《說文》：“收，捕也。从攴，丩聲。”', '《說文》：“省，視也。从眉省，从屮。𡮀，古文从少，从囧。”', '《說文》：“𪄿，鳥也。从鳥，堇聲。難，𪄿或从隹。”', '《說文》：“受，相付也。从𠬪，舟省聲。”', '《說文》：“𠛰，分解也。从冎，从刀。”', '《說文》：“愛，行皃。从夊，㤅聲。”', '《說文》：“弟，韋束之次弟也。从古字之象。𠂖，古文弟，从古文韋省，丿聲。”', '《說文》：“條，小枝也。从木，攸聲。”', '《說文》：“才，艸木之初也。从丨上貫一，將生枝葉。一，地也。”', '《說文》：“華，榮也。从艸，从𠌶。”', '《說文》：“寫，置物也。从宀，舄聲。”', '《說文》：“何，儋也。从人，可聲。”', '《說文》：“代，更也。从人，弋聲。”', '《說文》：“比，密也。二人為从，反从為比。夶，古文比。”', '《說文》：“表，上衣也。从衣，从毛‧古者衣裘，以毛為表。𧞧，古文表从麃。”', '《說文》：“裘，皮衣也。从衣，求聲。一曰象形，與衰同意。求，古文省衣。”', '《說文》：“光，明也。从火在人上，光明意也。𤐥，古文。炗，古文。”', '《說文》：“夫，丈夫也。从大，一以象簪也。周制以八寸為尺，十尺為丈，人長八尺，故曰丈夫。”', '《說文》：“河，水。出焞煌塞外昆侖山，發原注海。从水，可聲。”', '《說文》：“江，水。出蜀湔氐徼外崏山，入海。从水，工聲。”', '《說文》：“臺，觀，四方而高者。从至、从之、从高省。與室屋同意。”', '《說文》：“風，八風也。東方曰明庶風；東南曰清明風；南方曰景風；西南曰涼風；西方曰閶闔風；西北曰不周風；北方曰廣莫風；東北曰融風。風動蟲生，故蟲八日而化。从虫，凡聲。凬，古文風。”', '《說文》：“畍，境也。从田，介聲。”', '《說文》：“金，五色金也。黄為之長，久薶不生衣，百鍊不輕，从革不違。西方之行，生於土，从土，左右注象金在土中形，今聲。𠊍，古文金。”', '《說文》：“且，薦也。从几，足有二橫，一其下地也。”', '《說文》：“萬，蟲也。从厹，象形。”', '《說文》：“己，中宮也，象萬物辟藏詘形也。己承戊，象人腹，𢀒，古文己。”', '《說文》：“育，養子使作善也。从𠫓，肉聲。《虞書》曰：‘教育子。’毓，育或从每。”', '《說文》：“元，始也。从一，从兀。”', '《說文》：“社，地主也。从示、土。《春秋傳》曰：‘共工之子句龍為社神。’《周禮》：‘二十五家為社，各樹其土所宜之木。’𥙭，古文社。”', '《說文》：“班，分瑞玉。从玨，从刀。”', '《說文》：“命，使也。从口，从令。”', '《說文》：“局，促也。从口在尺下，復局之。一曰博所以行棊。象形。”', '《說文》：“論，議也。从言，侖聲。”', '《說文》：“該，軍中約也。从言，亥聲。讀若‘心中滿該’。”', '《說文》：“及，逮也。从又，从人。乁，古文及，《秦刻石》及如此。𢎜，亦古文及。𨕤，亦古文及。”', '《說文》：“友，同志為友。从二又，相交友也。𠬺，古文友。𦐮。亦古文友。”', '《說文》：“數，計也。从攴，婁聲。”', '《說文》：“眼，目也。从目，𥃩聲。”', '《說文》：“死，澌也，人所離也。从歺，从人。𠒁，古文死如此。”', '《說文》：“號，呼也。从号，从虎。”', '《說文》：“喜，樂也。从壴，从口。歖，古文喜从欠，與歡同。”', '《說文》：“樹，生植之緫名。从木，尌聲。尌，籀文。”', '《說文》：“極，棟也。从木，亟聲。”', '《說文》：“樂，五聲八音緫名。象鼓鞞。木，虡也。”', '《說文》：“林，平土有叢木曰林。从二木。”', '《說文》：“員，物數也。从貝，口聲。鼎，籀文从鼎。”', '《說文》：“早，晨也。从日在甲上。”', '《說文》：“期，會也。从月，其聲。𣅆，古文期，从日、丌。”', '《說文》：“完，全也。从宀，元聲。古文以為寬字。”', '《說文》：“空，竅也。从穴，工聲。”', '《說文》：“帶，紳也。男子鞶帶，婦人帶絲，象繫佩之形。佩必有巾，从巾。”', '《說文》：“布，枲織也。从巾，父聲。”', '《說文》：“府，文書藏也。从广，付聲。”', '《說文》：“馬，怒也；武也。象馬頭髦尾四足之形。𢒠，古文。𢒠，籀文馬與𢒠同，有髦。”', '《說文》：“交，交脛也。从大，象交形。”', '《說文》：“洋，水。出齊臨朐高山，東北入鉅定。从水，羊聲。”', '《說文》：“清，朖也，澂水之皃。从水，青聲。”', '《說文》：“飛，鳥翥也。象形。”', '《說文》：“非，違也。从飛下翄，取其相背。”', '《說文》：“接，交也。从手，妾聲。”', '《說文》：“婚，婦家也。禮，娶婦以昏時。婦人陰也，故曰婚。从女，从昏，昏亦聲。𡕽，籀文婚。”', '《說文》：“義，己之威儀也。从我羊。羛，《墨翟書》義从弗。魏郡有羛陽鄉，讀若錡。今屬鄴，本內黃北二十里。”', '《說文》：“望，出亡在外，望其還也。从亡，朢省聲。”', '《說文》：“張，施弓弦也。从弓，長聲。”', '《說文》：“結，締也。从糸，吉聲。”', '《說文》：“錢，銚也，古田器。从金，戔聲。《詩》曰：‘庤乃錢鎛。’”', '《說文》：“未，味也，六月滋味也。五行，木老於未，象木重枝葉也。”', '《說文》：“球，玉聲也。从玉，求聲。璆，球或从翏。”', '《說文》：“英，艸榮而不實者。一曰黃英。从艸，央聲。”', '《說文》：“若，擇菜也。从艸、右。右，手也。一曰杜若，香艸。”', '《說文》：“半，物中分也。从八，从牛。牛為物大，可以分也。”', '《說文》：“告，牛觸人，角箸橫木，所以告人也。从口，从牛。《易》曰：‘僮牛之告。’”', '《說文》：“造，就也。从辵，告聲。譚長說，造，上士也。艁，古文造从舟。”', '《說文》：“運，迻徙也。从辵，軍聲。”', '《說文》：“近，附也。从辵，斤聲。𣥍，古文近。”', '《說文》：“往，之也。从彳，𡉚聲。𨓏，古文从辵。”', '《說文》：“千，十百也。从十，从人。”', '《說文》：“議，語也。从言，義聲。”', '《說文》：“計，會也，筭也。从言，从十。”', '《說文》：“講，和解也。从言，冓聲。”', '《說文》：“𠦛，械也。从廾持斤，并力之兒。𠈯，古文兵从人、廾、干。兵，籀文。”', '《說文》：“興，起也。从舁，从同。同力也。”', '《說文》：“取，捕取也。从又，从耳。《周禮》：‘獲者取左耳。’《司馬法》曰：‘載獻聝。’聝者，耳也。”', '《說文》：“度，法制也。从又，庶省聲。”', '《說文》：“變，更也。从攴，䜌聲。”', '《說文》：“㪅，改也。从攴，丙聲。”', '《說文》：“羣，輩也。从羊，君聲。”', '《說文》：“則，等畫物也。从刀，从貝。貝，古之物貨也。𠟻，古文則。𠞋，亦古文則。𠟭，籀文則从鼎。”', '《說文》：“算，數也，从竹，从具，讀若筭。”', '《說文》：“哥，聲也。从二可。古文以為謌字。”', '《說文》：“產，生也。从生，彥省聲。”', '《說文》：“罷，遣有辠也。从网、能，言有賢能而入网，而貰遣之。《周禮》曰：‘議能之辟。’”', '《說文》：“衣，依也。上曰衣，下曰裳。象覆二人之形。”', '《說文》：“服，用也。一曰車右騑，所以舟旋。从舟，𠬝聲。𣍞，古文服，从人。”', '《說文》：“形，象形也。从彡，幵聲。”', '《說文》：“易，蜥易，蝘蜓，守宮也。象形。《秘書》說，日月為易，象陰陽也。一曰从勿。”', '《說文》：“類，種類相似，唯犬為甚。从犬，頪聲。”', '《說文》：“照，明也。从火，昭聲。”', '《說文》：“至，鳥飛从高下至地也。从一，一猶地也。象形。不，上去。而至，下來也。𦤳，古文至。”', '《說文》：“失，縱也。从手，乙聲。”', '《說文》：“姐，蜀謂母曰姐，淮南謂之社。从女，且聲。”', '《說文》：“戰，鬭也。从戈，單聲。”', '《說文》：“勞，劇也。从力，熒省。熒火燒冂，用力者勞。𢥒，古文勞从悉。”', '《說文》：“鐵，黑金也。从金，𢧜聲。𨫓，鐵或省。銕，古文鐵从夷。”', '《說文》：“神，天神，引出萬物者也。从示、申。”', '《說文》：“君，尊也。从尹；發號，故从口。𠱭，古文象君坐形。”', '《說文》：“送，遣也。从辵，㑞省。𨕩，籀文不省。”', '《說文》：“達，行不相遇也。从辵，羍聲。《詩》曰：‘挑兮達兮’。达，達或从大。或曰迭。”', '《說文》：“遠，遼也。从辵，袁聲。𨖸，古文遠。”', '《說文》：“跟，足踵也。从足，㫐聲。𣥦，跟或从止。”', '《說文》：“古，故也。从十口。識前言者也。𠖠，古文古。”', '《說文》：“讀，誦書也。从言，賣聲。”', '《說文》：“音，聲也。生於心有節於外謂之音；宮商角徵羽聲；絲竹金石匏土革木音也。从言，含一。”', '《說文》：“童，男有辠曰奴，奴曰童。女曰妾。从䇂，重省聲。𥫍，籀文童，中與𥩓中同从𠥻。𠥻，以為古文疾字。”', '《說文》：“目，人眼。象形。重童子也。𡇡，古文目。”', '《說文》：“隻，鳥一枚也。从又持隹。持一隹曰隻，二隹曰雙。”', '《說文新附》：“此字本闕。臣鉉等案：孫愐《唐韻》引《說文》云‘喜也，从竹，从犬’，而不述其義。今俗皆从犬。又案：李陽冰刊定《說文》‘从竹，从夭’，義云‘竹得風其體夭屈如人之笑’。未知其審。”', '《說文》：“食，一米也。从皀，亼聲。或說亼皀也。”', '《說文》：“木，冒也，冒地而生。東方之行。从屮，下象其根。”', '《說文》：“末，木上曰末。从木，一在其上。”', '《說文》：“晚，莫也。从日，免聲。”', '《說文》：“曐，萬物之精，上為列星。从晶，生聲。一曰象形，从口，古口復注中，故與日同。𠻖，古文星。星，曐或省。”', '《說文》：“究，窮也。从穴，九聲。”', '《說文》：“病，疾加也。从疒，丙聲。”', '《說文》：“保，養也。从人，从𤔍省。𤔍，古文孚。𣎼，古文保。𠊻，古文保不省。”', '《說文新附》：“倒，仆也。从人，到聲。”', '《說文》：“化，教行也。从𠤎，从人，𠤎亦聲。”', '《說文》：“歡，喜樂也。从欠，雚聲。”', '《說文》：“題，頟也。从頁，是聲。”', '《說文》：“熱，溫也。从火，埶聲。”', '《說文》：“性，人之陽气性善者也。从心，生聲。”', '《說文》：“滿，盈溢也。从水，㒼聲。”', '《說文》：“決，行流也。从水，从夬。廬江有決水，出於大別山。”', '《說文》：“𣹭，水行也。从沝、㐬，㐬，突忽也。流，篆文从水。”', '《說文》：“房，室在旁也。从戶，方聲。”', '《說文》：“擧，對舉也。从手，與聲。”', '《說文》：“直，正見也。从𠃊，从十，从目。𣓟，古文直。”', '《說文》：“約，纏束也。从糸，勺聲。”', '《說文》：“雖，似蜥蜴而大。从虫，唯聲。”', '《說文》：“強，蚚也。从虫，弘聲。𧖑，籀文強，从䖵从彊。”', '《說文》：“𡊎，止也。从土，从留省，土，所止也。此與留同意。坐，古文坐。”', '《說文》：“黃，地之色也。从田，从炗，炗亦聲。炗，古文光。𡕛，古文黃。”', '《說文》：“功，以勞定國也。从力，从工，工亦聲。”', '《說文新附》：“辦，致力也。从力，辡聲。”', '《說文》：“士，事也。數始於一，終於十。从一，从十。孔子曰：‘推十合一為士。’”', '《說文》：“苦，大苦，苓也。从艸，古聲。”', '《說文》：“特，朴特，牛父也。从牛，寺聲。”', '《說文新附》：“呀，張口皃。从口，牙聲。”', '《說文》：“步，行也。从止，𣥂相背。”', '《說文》：“連，員連也。从辵，从車。”', '《說文》：“德，升也。从彳，𢛳聲。”', '《說文》：“建，立朝律也。从聿，从廴。”', '《說文》：“商，从外知內也。从㕯，章省聲。𠿧，古文商。𠹧，亦古文商。𡅟，籀文商。”', '《說文》：“設，施陳也。从言，从殳。殳，使人也。”', '《說文》：“記，疏也。从言，己聲。”', '《說文》：“習，數飛也。从羽，从白。”', '《說文》：“制，裁也。从刀，从未。未，物成，有滋味，可裁斷。一曰止也。𠝁，古文制如此。”', '《說文》：“解，判也。从刀判牛角。一曰解廌，獸也。”', '《說文》：“節，竹約也。从竹，即聲。”', '《說文》：“權，黃華木。从木，雚聲。一曰反常。”', '《說文》：“買，市也。从网、貝。《孟子》曰：‘登壟斷而网市利。’”', '《說文》：“院，堅也。从𨸏，完聲。”', '《說文》：“容，盛也。从宀、谷。㝐，古文容从公。”', '《說文》：“害，傷也。从宀，从口。宀、口，言从家起也。丰聲。”', '《說文》：“任，符也。从人，壬聲。”', '《說文》：“傳，遽也。从人，專聲。”', '《說文》：“船，舟也。从舟，鉛省聲。”', '《說文》：“㱁，意有所欲也。从欠，省。歀，㱁或从柰。”', '《說文》：“色，顏气也。从人，从卪。𢒸，古文。”', '《說文》：“石，山石也。在厂之下，口象形。”', '《說文》：“研，䃺也。从石，幵聲。”', '《說文》：“念，常思也。从心，今聲。”', '《說文》：“怕，無為也。从心，白聲。”', '《說文》：“治，水。出東萊曲城陽丘山，南入海。从水，台聲。”', '《說文》：“指，手指也。从手，旨聲。”', '《說文》：“提，挈也。从手，是聲。”', '《說文》：“婦，服也。从女持帚，灑掃也。”', '《說文》：“土，地之吐生物者也。二象地之下、地之中物出形也。”', '《說文》：“務，趣也。从力，敄聲。”', '《說文》：“銀，白金也。从金，艮聲。”', '《說文》：“巴，蟲也。或曰食象蛇。象形。”', '《說文》：“帝，諦也。王天下之號也。从丄，朿聲。𢂇，古文帝。古文諸丄字皆从一，篆文皆从𠄞，𠄞，古文上字。”', '《說文》：“玩，弄也。从玉，元聲。貦，玩或从貝。”', '《說文》：“曾，詞之舒也。从八，从曰，𡆧聲。”', '《說文》：“足，人之足也，在下。从止、囗。”', '《說文》：“品，眾庶也。从三口。”', '《說文》：“言，直言曰言，論難曰語。从口，䇂聲。”', '《說文》：“語，論也。从言，吾聲。”', '《說文》：“識，常也。一曰知也。从言，戠聲。”', '《說文》：“反，覆也。从又、厂。反形。𠬡，古文。”', '《說文》：“改，更也。从攴、己。”', '《說文》：“費，散財用也。从貝，弗聲。”', '《說文》：“精，擇也。从米，青聲。”', '《說文》：“備，慎也。从人，䓒聲。𠈍，古文備。”', '《說文》：“屋，居也。从尸，尸，所主也。一曰尸象屋形；从至，至，所至止。室、屋皆从至。𡲃，籀文屋，从厂。𦤼，古文屋。”', '《說文》：“觀，諦視也。从見，雚聲。𥸑，古文觀从囧。”', '《說文》：“縣，繫也。从系持𥄉。”', '《說文》：“須，面毛也。从頁，从彡。”', '《說文》：“敬，肅也。从攴、茍。”', '《說文》：“廢，屋頓也。从广，發聲。”', '《說文》：“思，容也。从心，囟聲。”', '《說文》：“注，灌也。从水，主聲。”', '《說文》：“消，盡也。从水，肖聲。”', '《說文》：“魚，水蟲也。象形。魚尾與燕尾相似。”', '《說文》：“妹，女弟也。从女，未聲。”', '《說文》：“統，紀也。从糸，充聲。”', '《說文》：“它，虫也。从虫而長，象冤曲垂尾形。上古艸居患它，故相問無它乎。蛇，它或从虫。”', '《說文》：“城，以盛民也。从土，从成，成亦聲。𩫨，籀文城从𩫏。”', '《說文》：“場，祭神道也；一曰田不耕；一曰治穀田也。从土，昜聲。”', '《說文》：“田，陳也，樹穀曰田。象四口，十，阡陌之制也。”', '《說文》：“助，左也。从力，且聲。”', '《說文》：“勝，任也。从力，朕聲。”', '《說文新附》：“勢，盛力，權也。从力，埶聲。”', '《說文》：“料，量也。从斗，米在其中。”', '《說文》：“陽，高明也。从𨸏，昜聲。”', '《說文》：“除，殿陛也。从𨸏，余聲。”', '《說文》：“午，啎也。五月陰氣午逆陽，冒地而出。此予矢同意。”', '《說文》：“歸，女嫁也。从止，从婦省，𠂤聲。㱕，籀文，省。”', '《說文》：“選，遣也。从辵、巽。巽遣之，巽亦聲。一曰選擇也。”', '《說文》：“器，皿也。象器之口，犬所以守之。”', '《說文》：“弄，玩也。从廾持玉。”', '《說文》：“䢉，耕也。从䢅，囟聲。𨑋，籀文䢉从林。𦦥，古文䢉；辳，亦古文䢉。”', '《說文》：“畫，界也。象田四界，聿所以畫之。𨽶，古文畫省。𠟷亦古文畫。”', '《說文》：“專，六寸簿也。从寸，叀聲。一曰專，紡專。”', '《說文》：“皮，剝取獸革者謂之皮。从又，為省聲。𥬖，古文皮。𠰎，籀文皮。”', '《說文》：“救，止也。从攴，求聲。”', '《說文》：“離，離黃，倉庚也。鳴則蠶生。从隹，离聲。”', '《說文》：“𠭖，進取也。从𠬪，古聲。𣪏，籀文𠭖；𢽤，古文𠭖。”', '《說文》：“切，刌也。从刀，七聲。”', '《說文》：“刻，鏤也。从刀，亥聲。”', '《說文》：“管，如箎，六孔，十二月之音，物開地牙，故謂之管。从竹，官聲。琯，古者玉琯以玉。舜之時，西王母來獻其白琯。前零陵文學姓奚，於伶道舜祠下得笙玉琯。夫以玉作音，故神人以和，鳳皇來儀也。从玉，官聲。”', '《說文》：“青，東方色也。木生火，从生丹，丹青之信言象然。𡗡，古文青。”', '《說文》：“卽，即食也。从皀，卪聲。”', '《說文》：“養，供養也。从食，羊聲。𢼝，古文養。”', '《說文》：“飯，食也。从食，反聲。”', '《說文》：“良，善也。从畗省，亡聲。”', '《說文》：“久，以後灸之，象人兩脛後有距也。”', '《說文》：“曑，商星也。从晶，㐱聲。參，曑或省。”', '《說文》：“片，判木也。从半木。”', '《說文》：“稱，銓也。从禾，爯聲。春分而禾生，日夏至晷景可度，禾有秒，秋分而秒定。律數十二，秒而當一分，十分而寸。其以為重，十二粟為一分，十二分為一銖。故諸程品皆从禾。”', '《說文新附》：“價，物直也。从人、賈，賈亦聲。”', '《說文》：“量，稱輕重也。从重省，曏省聲。𨤦，古文量。”', '《說文》：“裝，裹也。从衣，壯聲。”', '《說文》：“願，大頭也。从頁，原聲。”', '《說文》：“印，執政所持信也。从爪，从卪。”', '《說文》：“廣，殿之大屋也。从广，黄聲。”', '《說文》：“黑，火所熏之色也。从炎上出囦。囦古䆫字。”', '《說文》：“漸，水。出丹陽黟南蠻中，東入海。从水，斬聲。”', '《說文》：“濟，水。出常山房子贊皇山，東入泜。从水，齊聲。”', '《說文》：“雨，水从雲下也。一象天，冂象雲，水霝其間也。𠕲，古文。”', '《說文》：“職，記微也。从耳，戠聲。”', '《說文》：“細，微也。从糸，囟聲。”', '《說文》：“級，絲次弟也。从糸，及聲。”', '《說文》：“紅，帛赤白色。从糸，工聲。”', '《說文》：“組，綬屬。其小者，以為冕纓。从糸，且聲。”', '《說文》：“綫，縷也。从糸，戔聲。線，古文綫。”', '《說文》：“落，凡艸曰零，木曰落。从艸，洛聲。”', '《說文》：“草，草斗，櫟實也。一曰象斗子。从艸，早聲。”', '《說文》：“周，密也。从用、口。𠄗，古文周字从古文及。”', '《說文》：“單，大也。从吅、，吅亦聲。闕。”', '《說文》：“歲，木星也。越歷二十八宿，宣徧陰陽，十二月一次。从步，戌聲。律歷書名五星為五步。”', '《說文》：“諸，辯也。从言，者聲。”', '《說文》：“誰，何也。从言，隹聲。”', '《說文》：“竟，樂曲盡為竟。从音，从人。”', '《說文》：“爾，麗爾，猶靡麗也。从冂，从㸚，其孔㸚；尒聲。此與爽同意。”', '《說文》：“雧，羣鳥在木上也。从雥，从木。集，雧或省。”', '《說文》：“爭，引也。从𠬪、厂。”', '《說文》：“肉，胾肉。象形。”', '《說文》：“初，始也。从刀，从衣。裁衣之始也。”', '《說文》：“盡，器中空也。从皿，㶳聲。”', '《說文》：“旣，小食也。从皀，旡聲。《論語》曰：‘不使勝食旣。’”', '《說文》：“根，木株也。从木，艮聲。”', '《說文》：“鄉，國離邑，民所封鄉也。嗇夫別治，封圻之內六鄉，六鄉治之。从𨛜，皀聲。”', '《說文》：“齊，禾麥吐穗上平也。象形。”', '《說文》：“穿，通也。从牙在穴中。”', '《說文》：“假，非真也。从人，叚聲。一曰至也。《虞書》曰：‘假于上下。’”', '《說文》：“件，分也。从人，从牛。牛，大物，故可分。”', '《說文》：“眾，多也，从㐺、目，眾意。”', '《說文》：“毛，眉髮之屬及獸毛也。象形。”', '《說文》：“般，辟也。象舟之旋，从舟，从殳。殳，所以旋也。𦨗，古文般从支。”', '《說文》：“包，象人褢妊，巳在中，象子未成形也。”', '《說文》：“破，石碎也。从石，皮聲。”', '《說文》：“𤐫，火飛也。从火、。與𠨧同意。”', '《說文》：“㤂，褊也。从心，及聲。”', '《說文》：“忽，忘也。从心，勿聲。”', '《說文》：“漢，漾也，東為滄浪水。从水，難省聲。㵄，古文。”', '《說文》：“州，水中可居曰州。周遶其旁，从重川。昔堯遭洪水，民居水中高土，或曰九州。《詩》曰：‘在河之州’。一曰：州，疇也。各疇其土而生之。𠃕，古文州。”', '《說文》：“推，排也。从手，隹聲。”', '《說文》：“戲，三軍之偏也。一曰兵也。从戈，䖒聲。”', '《說文》：“凷，墣也。从土，一屈象形。塊，凷或从鬼。”', '《說文》：“里，居也。从田，从土。”', '《說文》：“男，丈夫也。从田，从力，言男用力於田也。”', '《說文》：“禮，履也，所以事神致福也。从示、从豊，豊亦聲。𠃞，古文禮。”', '《說文》：“福，祐也。从示，畐聲。”', '《說文》：“牛，大牲也，牛件也。件，事理也。象角頭三，封尾之形。”', '《說文》：“唱，導也。从口，昌聲。”', '《說文》：“隨，从也。从辵，𡐦省聲。”', '《說文》：“衞，宿衞也。从韋、帀，从行。行，列衞也。”', '《說文》：“談，語也。从言，炎聲。”', '《說文》：“討，治也。从言，从寸。”', '《說文》：“殺，戮也。从殳，杀聲。𤔮，古文殺；𢽅，古文殺；𢁛，古文殺。”', '《說文》：“啟，教也。从攴，启聲。《論語》曰：‘不憤不啟。’”', '《說文》：“腳，脛也。从肉，卻聲。”', '《說文》：“𧷓，出物貨也。从出，从買。”', '《說文》：“團，圜也。从囗，專聲。”', '《說文》：“資，貨也。从貝，次聲。”', '《說文》：“夜，舍也。天下休舍也。从夕，亦省聲。”', '《說文》：“科，程也。从禾，从斗。斗者，量也。”', '《說文》：“客，寄也。从宀，各聲。”', '《說文》：“付，與也。从寸，持物對人。”', '《說文》：“借，假也。从人，昔聲。”', '《說文》：“似，象也。从人，㠯聲。”', '《說文》：“俄，行頃也。从人，我聲。”', '《說文》：“傷，創也。从人，𥏻省聲。”', '《說文》：“係，絜束也。从人，从系，系亦聲。”', '《說文》：“令，發號也。从亼、卪。”', '《說文》：“㠀，海中往往有山可依止曰㠀。”', '《說文》：“息，喘也。从心，从自，自亦聲。”', '《說文》：“志，意也。从心，之聲。”', '《說文》：“怪，異也。从心，圣聲。”', '《說文》：“感，動人心也。从心，咸聲。”', '《說文》：“聯，連也。从耳，耳連於頰也；从絲，絲連不絕也。”', '《說文》：“拉，摧也。从手，立聲。”', '《說文》：“據，杖持也。从手，豦聲。”', '《說文》：“武，楚莊王曰：夫武，定功戢兵。故止戈為武。”', '《說文》：“畱，止也。从田，丣聲。”', '《說文》：“防，隄也。从𨸏，方聲。埅，防或从土。”', '《說文》：“亞，醜也。象人局背之形。賈侍中說以為次弟也。”', '《說文》：“旁，溥也。从二，闕，方聲。𣃟，古文㫄；𣃙，亦古文㫄；雱，籀文。”', '《說文》：“蘇，桂荏也。从艸，穌聲。”', '《說文》：“萅，推也。从艸，从日，艸，春時生也，屯聲。”', '《說文》：“哭，哀聲也。从吅，獄省聲。”', '《說文》：“遇，逢也。从辵，禺聲。”', '《說文》：“迫，近也。从辵，白聲。”', '《說文》：“讓，相責讓。从言，襄聲。”', '《說文》：“筆，秦謂之筆。从聿，从竹。”', '《說文》：“緊，纏絲急也。从臤，从絲省。”', '《說文》：“睡，坐寐也。从目、垂。”', '《說文》：“雞，知時畜也。从隹，奚聲。鷄，籀文雞从鳥。”', '《說文》：“舊，𨾦舊，舊留也。从萑，臼聲。鵂，舊或从鳥，休聲。”', '《說文》：“鳥，長尾禽緫名也。象形，鳥之足似匕，从匕。”', '《說文》：“奇，異也。一曰不耦。从大，从可。”', '《說文》：“餘，饒也。从食，余聲。”', '《說文》：“格，木長皃。从木，各聲。”', '《說文》：“園，所以樹果也。从囗，袁聲。”', '《說文》：“米，粟實也。象禾實之形。”', '《說文》：“察，覆也。从宀、祭。”', '《說文》：“富，備也。一曰厚也。从宀，畐聲。”', '《說文》：“宗，尊祖廟也。从宀，从示。”', '《說文》：“製，裁也。从衣，从制。”', '《說文》：“居，蹲也。从尸，古者居从古。踞，俗居从足。”', '《說文》：“歌，詠也。从欠，哥聲。謌，謌（歌）或从言。”', '《說文》：“𤾕，廢，一偏下也。从竝，白聲。暜，或从曰。㬱，或从兟，从曰。”', '《說文》：“恐，懼也。从心，巩聲。𢖶，古文。”', '《說文》：“深，水。出桂陽南平，西入營道。从水，罙聲。”', '《說文》：“油，水。出武陵孱陵西，東南〔北〕入江。从水，由聲。”', '《說文》：“冷，寒也。从仌。令聲。”', '《說文》：“始，女之初也。从女，台聲。”', '《說文》：“織，作布帛之總名也。从糸，戠聲。”', '《說文》：“紀，絲別也。从糸，己聲。”', '《說文》：“斯，析也。从斤，其聲。《詩》曰：‘斧以斯之。’”', '《說文》：“阿，大陵也。一曰曲𨸏也。从𨸏，可聲。”', '《說文》：“隊，從高隊也。从𨸏，㒸聲。”', '《說文》：“乾，上出也。从乙。乙，物之達也。倝聲。𠄃，籀文乾。”', '《說文》：“亂，治也。从乙。乙，治之也。从𤔔。”', '《說文》：“酒，就也，所以就人性之善惡。从水、从酉，酉亦聲。一曰造也，吉凶所造也。古者儀狄作酒醪，禹嘗之而美，逐䟽儀狄。杜康作秫酒。”', '《說文》：“越，度也。从走，戊聲。”', '《說文》：“遺，亡也。从辵，䝿聲。”', '《說文》：“待，竢也。从彳，寺聲。”', '《說文》：“句，曲也。从口，丩聲。”', '《說文》：“調，和也。从言，周聲。”', '《說文》：“訴，告也。从言，厈省聲。《論語》曰：‘訴子路於季孫。’𧪜，訴或从言、朔。愬，訴或从朔、心。”', '《說文》：“具，共置也。从廾，从貝省。古以貝為貨。”', '《說文》：“導，導引也。从寸，道聲。”', '《說文》：“敗，毁也。从攴、貝。敗賊皆从貝，會意。贁，籀文敗，从賏。”', '《說文》：“刀，兵也。象形。”', '《說文》：“京，人所為絕高丘也。从高省，丨象高形。”', '《說文》：“夏，中國之人也。从夊、从頁、从𦥑。𦥑，兩手；夊，兩足也。𠍺，古文𡕾（夏）。”', '《說文》：“李，果也。从木，子聲。杍，古文。”', '《說文》：“財，人所寶也。从貝，才聲。”', '《說文》：“質，以物相贅，从貝，从斦。闕。”', '《說文》：“昨，壘日也。从日，乍聲。”', '《說文》：“室，實也。从宀，从至。至，所止也。”', '《說文》：“仍，因也。从人，乃聲。”', '《說文》：“考，老也。从老省，丂聲。”', '《說文》：“項，頭後也。从頁，工聲。”', '《說文新附》：“預，安也。案經典通用豫。从頁，未詳。”', '《說文》：“卻，節欲也。从卪，𧮫聲。”', '《說文》：“序，東西牆也。从广，予聲。”', '《說文》：“鼠，穴蟲之總名也，象形。”', '《說文》：“亦，人之臂亦也。从大，象兩亦之形。”', '《說文》：“惡，過也。从心，亞聲。”', '《說文》：“雲，山川气也。从雨，云象雲回轉形。云，古文省雨。，亦古文雲。”', '《說文》：“聞，知聞也。从耳，門聲。䎽，古文从昏。”', '《說文》：“區，踦區，藏匿也。从品在匸中。品，眾也。”', '《說文》：“編，次簡也。从糸，扁聲。”', '《說文》：“紙，絮一笘也。从糸，氏聲。”', '《說文》：“增，益也。从土，曾聲。”', '《說文》：“鐘，樂鐘也。秋分之音，物穜成。从金，童聲。古者垂作鐘。銿，鐘或从甬。”', '《說文》：“輕，輕車也。从車，巠聲。”', '《說文》：“陸，高平地。从𨸏，从坴，坴亦聲。𨽰，籀文陸。”', '《說文》：“醫，治病工也。殹，惡姿也，醫之性然。得酒而使。从酉。王育說。一曰殹，病聲。酒，所以治病也。《周禮》有醫酒。古者巫彭初作醫。”', '《說文》：“示，天垂象，見吉凶，所以示人也。从二；三垂，日、月、星也。觀乎天文以察時變，示，神事也。𥘅，古文示。”', '《說文》：“葉，艸木之葉也。从艸，枼聲。”', '《說文》：“呼，外息也。从口，乎聲。”', '《說文》：“止，下基也。象艸木出有址，故以止為足。”', '《說文》：“跳，蹶也。从足，兆聲。一曰躍也。”', '《說文》：“試，用也。从言，式聲。《虞書》曰：‘明試以功。’”', '《說文》：“譱，吉也。从誩，从羊。此與義、美同意。𦎍，篆文𦎍从言。”', '《說文》：“鳳，神鳥也。天老曰：鳳之象也，鴻前麐後，蛇頸魚尾，鸛顙鴛思，龍文虎背，燕頷雞喙，五色備舉。出於東方君子之國，翺翔四海之外，過崐崘，飲砥柱，濯羽弱水，莫宿風穴，見則天下大安寧。从鳥，凡聲。𠤈，古文鳳，象形。鳳飛羣鳥從以萬數，故以為朋黨字。𪆍，亦古文鳳。”', '《說文》：“角，獸角也。象形，角與刀魚相似。”', '《說文》：“差，貳也，差不相值也。从左，从𠂹。，籀文𢀩从二。”', '《說文》：“致，送詣也。从夂，从至。”', '《說文》：“圍，守也。从囗，韋聲。”', '《說文》：“貨，財也。从貝，化聲。”', '《說文》：“暗，日無光也。从日，音聲。”', '《說文》：“程，品也。十髮為程，十程為分，十分為寸。从禾，呈聲。”', '《說文》：“寶，珍也。从宀，从王，从貝，缶聲。寚，古文寶省貝。”', '《說文》：“痛，病也。从疒，甬聲。”', '《說文新附》：“停，止也。从人，亭聲。”', '《說文》：“兄，長也。从儿，从口。”', '《說文》：“司，臣司事於外者。从反后。”', '《說文》：“狗，孔子曰：‘狗，叩也，叩气吠以守。’从犬，句聲。”', '《說文》：“燒，爇也。从火，堯聲。”', '《說文》：“規，有法度也。从夫，从見。”', '《說文》：“派，別水也。从水，从𠂢，𠂢亦聲。”', '《說文》：“汽，水涸也。或曰泣下。从水，气聲。《詩》曰：‘汽可小康。’”', '《說文》：“𣿑，水派也，从水䢽聲。”', '《說文》：“承，奉也，受也。从手，从卪，从𠬞。”', '《說文》：“投，擿也。从手，从殳。”', '《說文》：“掉，搖也。从手，卓聲。《春秋傳》曰：‘尾大不掉。’”', '《說文》：“匪，器。似竹筐。从匚，非聲。《逸周書》曰：‘實玄黃于匪。’”', '《說文》：“引，開弓也。从弓、丨。”', '《說文》：“孫，子之子曰孫。从子，从系。系，續也。”', '《說文》：“終，絿絲也。从糸，冬聲。𡦿，古文終。”', '《說文》：“纔，帛雀頭色。一曰微黑色如紺。纔，淺也。讀若讒。从糸，毚聲。”', '《說文》：“壞，敗也。从土，褱聲。𡎯，古文壞省。𣀤，籀文壞。”', '《說文》：“錯，金涂也。从金，昔聲。”', '《說文》：“輪，有輻曰輪，無輻曰輇。从車，侖聲。”', '《說文》：“陳，宛丘，舜後媯滿之所封。从𨸏，从木，申聲。𨸬，古文陳。”', '《說文》：“祖，始廟也。从示，且聲。”', '《說文》：“菜，艸之可食者。从艸，采聲。”', '《說文新附》：“藏，匿也。”', '《說文》：“復，往來也。从彳，复聲。”', '《說文》：“術，邑中道也。从行，术聲。”', '《說文》：“護，救視也。从言，蒦聲。”', '《說文》：“謝，辤去也。从言，䠶聲。”', '《說文》：“革，獸皮治去其毛，革更之，象古文𠦶之形。𠦶，古文革，从三十，三十年為一世，而道更也。臼聲。”', '《說文》：“雙，隹二枚也。从雔，又持之。”', '《說文》：“畢，田罔也。从𠦒，象畢形微也。或曰甶聲。”', '《說文》：“ 乃，曳詞之難也。象气之出難。𢎧，古文乃。𠄕，籀文乃。”', '《說文》：“乎，語之餘也。从𠔃，象聲上越揚之形也。”', '《說文》：“盛，黍稷在器中以祀者也。从皿，成聲。”', '《說文》：“䝿，物不賤也。从貝，臾聲。臾，古文蕢。”', '《說文》：“族，矢鋒也，束之族族也。从㫃，从矢。”', '《說文》：“營，市居也。从宮，熒省聲。”', '《說文》：“敝，帗也。一曰敗衣。从攴，从㡀。㡀亦聲。”', '《說文》：“依，倚也。从人，衣聲。”', '《說文新附》：“低，下也。从人、氐，氐亦聲。”', '《說文》：“覺，寤也。从見，學省聲。一曰發也。”', '《說文》：“首，𦣻同，古文𦣻也。巛象髮，謂之鬊，鬊即巛也。”', '《說文》：“修，飾也。从彡，攸聲。”', '《說文》：“庭，宮中也。从广，廷聲。”', '《說文》：“獨，犬相得而鬭也。从犬，蜀聲。羊為羣，犬為獨也。一曰北囂山有獨𤞞獸，如虎，白身，豕鬣，尾如馬。”', '《說文》：“𡴘，吉而免凶也。从屰，从夭。夭死之事，故死謂之不𡴘。”', '《說文》：“端，直也。从立，耑聲。”', '《說文》：“慢，惰也。从心，曼聲。一曰慢，不畏也。”', '《說文》：“洗，洒足也。从水，先聲。”', '《說文》：“靠，相違也。从非，告聲。”', '《說文》：“持，握也。从手，寺聲。”', '《說文》：“練，湅繒也。从糸，柬聲。”', '《說文》：“絲，蠶所吐也。从二糸。”', '《說文》：“野，郊外也。从里，予聲。𡐨，古文野，从里省，从林。”', '《說文》：“𣃔，截也。从斤，从𢇍。𢇍，古文絕。𠸿，古文𣃔从𠧢，𠧢，古文叀字。《周書》曰：‘𠸿𠸿猗無他技。’𠜷亦古文。”', '《說文》：“尤，異也。从乙，又聲。”', '《說文》：“蘭，香艸也。从艸，闌聲。”', '《說文》：“歷，過也。从止，厤聲。”', '《說文》：“𢓴，卻也。一曰行遲也。从彳，从日，从夂。”', '《說文》：“響，聲也。从音，鄉聲。”', '《說文新附》：“鬧，不静也。从市、鬥。”', '《說文》：“整，齊也。从攴，从束，从正。正亦聲。”', '《說文》：“羊，祥也。从𦫳，象頭角足尾之形。孔子曰：牛羊之字，以形舉也。”', '《說文》：“背，𦟝也。从肉，北聲。”', '《說文》：“辦，判也。从刀，辡聲。”', '《說文》：“左，手相左助也。从𠂇、工。”', '《說文》：“式，法也。从工，弋聲。”', '《說文》：“䠶，弓弩發於身而中於遠也。从矢，从身。射，篆文䠶从寸。寸，法度也，亦手也。”', '《說文》：“乘，覆也。从入、桀。桀，黠也。軍法曰乘。𠅞，古文乘从几。”', '《說文》：“某，酸果也。从木，从甘，闕。槑，古文某从口。”', '《說文》：“案，几屬。从木，安聲。”', '《說文》：“橋，水梁也。从木，喬聲。”', '《說文》：“責，求也。从貝，朿聲。”', '《說文》：“克，肩也。象屋下刻木之形。𡱀，古文克。𠧹，亦古文克。”', '《說文》：“羅，以絲罟鳥也。从网，从維。古者芒氏初作羅。”', '《說文》：“展，轉也。从尸，𧝑省聲。”', '《說文》：“屬，連也。从尾，蜀聲。”', '《說文》：“視，瞻也。从見、示。𥄙，古文視；眡，亦古文視。”', '《說文》：“麗，旅行也。鹿之性見食急則必旅行。从鹿，丽聲。《禮》‘麗皮納聘’，蓋鹿皮也。𠀙，古文；𠧥，篆文麗字。”', '《說文》：“狀，犬形也。从犬，爿聲。”', '《說文》：“溫，水。出犍為涪，南入黔水。从水，𥁕聲。”', '《說文》：“演，長流也。一曰水名。从水，寅聲。”', '《說文》：“湖，大陂也。从水，胡聲。揚州浸有五湖。浸，川澤所仰以灌溉也。”', '《說文》：“準，平也。从水，隼聲。”', '《說文》：“聰，察也。从耳，怱聲。”', '《說文》：“𢳎，首至地也。从手、𠦪。𠦪，音忽。拜，揚雄說，拜从兩手下。𣬓，古文拜。”', '《說文》：“抵，擠也。从手，氐聲。”', '《說文》：“換，易也。从手，奐聲。”', '《說文》：“氏，巴蜀山名岸脅之旁箸欲落𡐦者曰氏。氏崩聲聞數百里。象形，乀聲。”', '《說文》：“絕，斷絲也。从糸，从刀，从卩。𢇍，古文絕，象不連體，絕二絲。”', '《說文》：“續，連也。从糸，賣聲。賡，古文續从庚、貝。”', '《說文》：“蟲，有足謂之蟲，無足謂之豸。从三虫。”', '《說文》：“基，牆始也。从土，其聲。”', '《說文》：“附，附婁，小土山也。从𨸏，付聲。《春秋傳》曰：‘附婁無松柏。’”', '《說文》：“玉，石之美。有五德：潤澤以溫，仁之方也；䚡理自外，可以知中，義之方也；其聲舒揚，專以遠聞，智之方也；不橈而折，勇之方也；銳廉而不技，絜之方也。象三玉之連，丨，其貫也。𤣪，古文玉。”', '《說文》：“蒙，王女也。从艸，冡聲。”', '《說文》：“尚，曾也，庶幾也。从八，向聲。”', '《說文》：“味，滋味也。从口，未聲。”', '《說文》：“逃，亡也。从辵，兆聲。”', '《說文》：“律，均布也。从彳，聿聲。”', '《說文》：“街，四通道也。从行，圭聲。”', '《說文》：“證，告也。从言，登聲。”', '《說文》：“者，別事詞也。从白，聲。，古文旅字。”', '《說文》：“剛，彊，斷也。从刀，岡聲。”', '《說文》：“館，客舍也。从食，官聲。《周禮》：‘五十里有市，市有館，館有積，以待朝聘之客。’”', '《說文新附》：“賽，報也。从貝，塞省聲。”', '《說文》：“景，光也。从日，京聲。”', '《說文》：“曉，明也。从日，堯聲。”', '《說文》：“香，芳也。从黍，从甘。《春秋傳》曰：‘黍稷馨香。’”', '《說文》：“守，守官也。从宀，从寸。寺府之事者。从寸，寸，法度也。”', '《說文》：“供，設也。从人，共聲。一曰供給。”', '《說文》：“充，長也；高也。从儿，育省聲。”', '《說文》：“密，山如堂者。从山，宓聲。”', '《說文新附》：“貓，貍屬。从豸，苗聲。”', '《說文》：“驗，馬名。从馬，僉聲。”', '《說文》：“驚，馬駭也。从馬，敬聲。”', '《說文》：“黨，不鮮也。从黑，尚聲。”', '《說文》：“洞，疾流也。从水，同聲。”', '《說文》：“永，長也，象水巠理之長。《詩》曰：‘江之永矣’。”', '《說文》：“耳，主聽也。象形。”', '《說文》：“抗，扞也。从手，亢聲。杭，抗或从木。”', '《說文》：“委，委隨也。从女，从禾。”', '《說文》：“凡，最括也。从二。二，偶也。从ㄋ。ㄋ，古文及。”', '《說文》：“堂，殿也。从土，尚聲。坣，古文堂。㙶，籀文堂从高。”', '《說文》：“壓，壞也。一曰塞補。从土，厭聲。”', '《說文》：“略，經略土地也。从田，各聲。”', '《說文》：“鏡，景也。从金，竟聲。”', '《說文》：“際，壁會也。从𨸏，祭聲。”', '《說文》：“藥，治病艸。从艸，樂聲。”', '《說文》：“吸，內息也。从口，及聲。”', '《說文》：“迎，逢也。从辵，卬聲。”', '《說文》：“微，隱行也。从彳，𣁋聲。《春秋傳》曰：‘白公其徒微之。’”', '《說文》：“訂，平議也。从言，丁聲。”', '《說文》：“𢿨，雜肉也。从肉，𢽳聲。”', '《說文》：“列，分解也。从刀，𣧄聲。”', '《說文》：“竹，冬生艸也。象形。下垂者，箁箬也。”', '《說文》：“簡，牒也。从竹，間聲。”', '《說文》：“益，饒也。从水、皿。皿，益之意也。”', '《說文》：“靜，審也。从青，爭聲。”', '《說文》：“短，有所長短，以矢為正。从矢，豆聲。”', '《說文》：“固，四塞也。从囗，古聲。”', '《說文》：“旗，熊旗五游，以象罰星，士卒以為期。从㫃，其聲。《周禮》曰：‘率都建旗。’”', '《說文》：“䢅，早昧爽也。从𦥑，从辰。辰，時也，辰亦聲。𠃨夕為𡖊，𦥑辰為䢅，皆同意。”', '《說文》：“麻，與𣏟同。人所治，在屋下。从广，从𣏟。”', '《說文》：“置，赦也。从网、直。”', '《說文》：“份，文質僣也。从人，分聲。《論語》曰：‘文質份份。’彬，古文份从彡、林。林者，从焚省聲。”', '《說文》：“健，伉也。从人，建聲。”', '《說文》：“傾，仄也。从人，从頃，頃亦聲。”', '《說文》：“歐，吐也。从欠，區聲。”', '《說文》：“頂，顛也。从頁，丁聲。𩒆，或从作。𩕢，籀文从鼎。”', '《說文》：“領，項也。从頁，令聲。”', '《說文》：“岸，水厓而高者。从屵，干聲。”', '《說文》：“危，在高而懼也。从厃，自卪止之。”', '《說文》：“象，長鼻牙，南越大獸，三年一乳。象耳牙四足之形。”', '《說文》：“沙，水𢿨石也。从水，从少，水少沙見。楚東有沙水。譚長說，沙，或从尐。”', '《說文》：“滅，盡也。从水，烕聲。”', '《說文》：“龍，鱗蟲之長。能幽能明，能細能巨，能短能長，春分而登天，秋分而潛淵。从肉，飛之形，童省聲。”', '《說文》：“鹽，鹹也。从鹵，監聲。古者宿沙初作煮海鹽。”', '《說文》：“排，擠也。从手，非聲。”', '《說文》：“彈，行丸也。从弓，單聲。𢎫，或从弓持丸。”', '《說文》：“繼，續也。从糸、㡭。一曰反𢇍為繼。”', '《說文》：“銅，赤金也。从金，同聲。”', '《說文》：“險，阻難也。从𨸏，僉聲。”', '《說文》：“限，阻也。一曰門榍。从𨸏，艮聲。”', '《說文》：“甲，東方之孟，陽气萌動。从木戴孚甲之象。一曰人頭宜為甲，甲象人頭。𠇚，古文甲，始於十，見於千，成於木之象。”', '《說文》：“存，恤問也。从子，才聲。”', '《說文》：“莊，上諱。𤖄，古文莊。”', '《說文》：“吹，噓也。从口，从欠。”', '《說文》：“喝，㵣也。从口，曷聲。”', '《說文》：“適，之也。从辵，啻聲。適，宋、魯語。”', '《說文》：“史，記事者也。从又持中；中，正也。”', '《說文》：“支，去竹之枝也。从手持半竹。𠦙，古文支。”', '《說文》：“尋，繹理也。从工，从口，从又，从寸。工、口，亂也；又、寸，分理之。彡聲。此與𤕦同意。度人之兩臂為尋，八尺也。”', '《說文》：“攻，擊也。从攴，工聲。”', '《說文》：“皆，俱詞也。从比，从白。”', '《說文》：“央，中央也。从大在冂之內。大，人也。央、旁同意。一曰久也。”', '《說文》：“麥，芒穀。秋穜厚薶，故謂之麥。麥，金也。金王而生，火王而死。从來，有穗者。从夕。”', '《說文》：“枝，木別生條也。从木，支聲。”', '《說文》：“槍，歫也。从木，倉聲。一曰槍欀也。”', '《說文》：“㮣，𣏙斗斛。从木，既聲。邵瑛羣經正字：“今經典多作概。”', '《說文》：“休，息止也。从人依木。庥，休或从广。”', '《說文》：“負，恃也。从人守貝有所恃也。一曰受貸不償。”', '《說文》：“游，旌旗之流也。从㫃，汓聲。𨒰，古文游。”', '《說文》：“積，聚也。从禾。責聲。”', '《說文》：“穅，穀皮也。从禾，从米，庚聲。康，穅或省。”', '《說文》：“宣，天子宣室也。从宀，亘聲。”', '《說文》：“席，籍也。《禮》：‘天子、諸侯席，有黼繡純飾。’从巾，庶省。𠩛，古文席，从石省。”', '《說文》：“伸，屈伸。从人，申聲。”', '《說文》：“臨，監臨也。从臥，品聲。”', '《說文》：“補，完衣也。从衣，甫聲。”', '《說文》：“尺，十寸也。人手卻十分動脈為寸口。十寸為尺。尺，所以指尺䂓榘事也。从尸，从乙，乙所識也。周制寸、尺、咫、尋、常、仞諸度量，皆以人之體為法。”', '《說文》：“詞，意內而言外也。从司，从言。”', '《說文》：“底，山居也。一曰下也。从广，氐聲。”', '《說文》：“恨，怨也。从心，艮聲。”', '《說文》：“冬，四時盡也。从仌，从夂。夂，古文終字。𣆼，古文冬从日。”', '《說文》：“需，𩓣也，遇雨不進止𩓣也。从雨，而聲。《易》曰：‘雲上於天，需。’”', '《說文》：“戶，護也。半門曰戶，象形。㦿，古文戶从木。”', '《說文》：“捉，搤也。从手，足聲。一曰握也。”', '《說文》：“搖，動也。从手，䍃聲。”', '《說文》：“妻，婦與夫齊者也。从女，从屮，从又。又，持事，妻職也。𡜈，古文妻从𡭙、女。𡭙，古文貴字。”', '《說文》：“右，手口相助也。从又，从口。”', '《說文》：“章，樂竟為一章。从音，从十。十，數之終也。”', '《說文》：“異，分也。从廾、从畀。畀，予也。”', '《說文》：“敵，仇也。从攴，啻聲。”', '《說文》：“雄，鳥父也。从隹，厷聲。”', '《說文》：“肥，多肉也。从肉，从卪。”', '《說文》：“刅，傷也。从刃，从一。創，或从刀，倉聲。”', '《說文》：“甘，美也。从口含一。一，道也。”', '《說文》：“鼓，郭也。春分之音，萬物郭皮甲而出，故謂之鼓。从壴。支，象其手擊之也。《周禮》：‘六鼓：靁鼓八面，靈鼓六面，路鼓四面，鼖鼓、皐鼓、晉鼓皆兩面。’𪔐，籀文鼓。从古聲。”', '《說文》：“豈，還師振旅樂也。一曰欲也，登也。从豆，微省聲。”', '《說文》：“血，祭所薦牲血也。从皿，一象血形。”', '《說文》：“爵，禮器也。象爵之形，中有鬯酒，又持之也，所以飲。器象爵者，取其鳴節節足足也。𥥼，古文爵，象形。”', '《說文》：“材，木梃也。从木，才聲。”', '《說文》：“築，擣也。从木，筑聲。𥵭，古文。”', '《說文》：“圓，圜。全也。从囗，員聲，讀若員。”', '《說文》：“困，故廬也。从木在囗中。𣏔，古文困。”', '《說文》：“施，旗皃。从㫃，也聲。亝欒施字子旗，知施者旗也。”', '《說文新附》：“糖，飴也。从米，唐聲。”', '《說文》：“值，措也。从人，直聲。”', '《說文》：“顧，還視也。从頁，雇聲。”', '《說文》：“豬，豕而三毛叢居者。从豕，者聲。”', '《說文》：“憐，哀也。从心，粦聲。”', '《說文新附》：“潔，瀞也。从水，絜聲。”', '《說文》：“冰，水堅也。从仌，从水。凝，俗冰从疑。”', '《說文》：“露，潤澤也。从雨，路聲。”', '《說文》：“捊，引取也。从手，孚聲。抱，捊或从包。”', '《說文》：“招，手呼也。从手，召聲。”', '《說文》：“威，姑也。从女，从戌。《漢律》曰：‘婦告威姑。’”', '《說文新附》：“境，疆也。从土，竟聲。經典通用竟。”', '《說文》：“勇，气也。从力，甬聲。𢦨，勇或从戈、用。恿，古文勇从心。”', '《說文》：“升，十龠也。从斗，亦象形。”', '《說文》：“範，範軷也。从車，笵省聲。讀與犯同。”', '《說文》：“季，少偁也。从子，从稚省，稚亦聲。”', '《說文》：“毒，厚也，害人之艸，往往而生。从屮，从毐。𦸕，古文毒，从刀、葍。”', '《說文》：“番，獸足謂之番。从采，田象其掌。𨆌番或从足、从煩。𥸨，古文番。”', '《說文》：“嚴，教命急也。从吅，𠪚聲。𡅮，古文。”', '《說文》：“登，上車也。从癶、豆，象登車形。𤼷，籀文登从収。”', '《說文》：“速，疾也。从辵，束聲。遬，籀文从欶。𧫣，古文人欶、从言。”', '《說文》：“彼，往有所加也。从彳，皮聲。”', '《說文》：“叔，拾也。从又，尗聲。汝南名收芋為叔。𡬧，叔或从寸。”', '《說文》：“段，椎物也。从殳，耑省聲。”', '《說文》：“虎，山獸之君。从虍，虎足象人足，象形……虝，古文虎。𧇂，亦古文虎。”', '《說文》：“丹，巴越之赤石也。象采丹井，一象丹形。𠁿，古文丹。㣋，亦古文丹。”', '《說文》：“舞，樂也。用足相背。从舛，舞聲。𦐀，古文舞从羽、亡。”', '《說文》：“暜，日無色也。从日，从竝。”', '《說文》：“私，禾也。从禾，厶聲。北道名禾主人曰私主人。”', '《說文》：“稅，租也。从禾，兌聲。”', '《說文》：“秋，禾穀孰也。从禾，𪚰省聲。𥤚，籀文不省。”', '《說文》：“粉，傅面者也。从米，分聲。”', '《說文》：“竆，極也。从穴，躳聲。”', '《說文》：“罪，捕魚竹网。从网、非。秦以罪為辠字。”', '《說文》：“伯，長也。从人，白聲。”', '《說文》：“俗，習也。从人，谷聲。”', '《說文》：“雜，五彩相會。从衣，集聲。”', '《說文》：“順，理也。从頁、从巛。”', '《說文》：“𤟌，嗾犬厲之也。从犬，將省聲。”', '《說文》：“狠，吠鬭聲。从犬，艮聲。”', '《說文》：“煙，火气也。从火，垔聲。烟，或从因；𡨾，古文；𤎟，籀文从宀。”', '《說文》：“囱，在牆曰牖，在屋曰囱。象形。窗，或从穴，𡆧，古文。”', '《說文》：“沿，緣水而下也。从水，㕣聲。《春秋傳》曰：‘王沿夏。’”', '《說文》：“況，寒水也。从水，兄聲。”', '《說文》：“擊，攴也。从手，𣪠聲。”', '《說文》：“維，車蓋維也。从糸，隹聲。”', '《說文》：“績，緝也。从糸，責聲。”', '《說文》：“勸，勉也。从力，雚聲。”', '《說文》：“疑，惑也。从子、止、匕，矢聲。”', '《說文新附》：“醒，醉解也。从酉，星聲。”', '《說文》：“祇，地祇，提出萬物者也。从示，氏聲。”', '《說文》：“皇，大也。从自，自，始也，始皇者，三皇大君也。自，讀若鼻，今俗以始生子為鼻子。”', '《說文》：“環，璧也。肉好若一謂之環。从玉，睘聲。”', '《說文》：“𩆜，靈巫，以玉事神。从玉，霝聲。靈，𤫊或从巫。”', '《說文》：“否，不也。从口，从不，不亦聲。”', '《說文》：“趣，疾也。从走，取聲。”', '《說文》：“奉，承也。从手，从廾，丰聲。”', '《說文》：“鬥，兩士相對，兵杖在後，象鬥之形。”', '《說文》：“骨，肉之覈也。从冎，有肉。”', '《說文》：“篇，書也。一曰關西謂榜曰篇。从竹，扁聲。”', '《說文》：“䇘，可以收繩也。从竹，象形，中象人手所推握也。互，䇘或省。”', '《說文》：“横，闌木也。从木，黄聲。”', '《說文》：“楚，叢木。一名荊也。从林，疋聲。”', '《說文》：“旅，軍之五百人為旅。从㫃，从从；从，俱也。𣥏，古文旅。古文以為魯、衛之魯。”', '《說文》：“寄，託也。从宀，奇聲。”', '《說文》：“幕，帷在上曰幕；覆食案亦曰幕。从巾，莫聲。”', '《說文》：“頓，下首也。从頁，屯聲。”', '《說文》：“顯，頭明飾也。从頁，㬎聲。”', '《說文》：“弱，橈也，上象橈曲，彡象毛氂橈弱也。弱物并，故从二。”', '《說文》：“髮，根也。从髟，犮聲。𩠖，髮或从首。𩑛，古文。”', '《說文》：“慶，行賀人也。从心，从夊，吉禮以鹿皮為贄，故从鹿省。”', '《說文》：“態，意也。从心，从能。㑷，或从人。”', '《說文》：“忘，不識也。从心，从亡，亡亦聲。”', '《說文》：“怒，恚也。从心，奴聲。”', '《說文》：“淨，魯北城門池也。从水，爭聲。”', '《說文》：“泥，水。出北地郁郅北蠻中。从水，尼聲。”', '《說文》：“激，水礙衺疾波也。从水，敫聲。一曰半遮也。”', '《說文》：“姓，人所生也。古之神聖母，感天而生子，故稱天子。从女，从生，生亦聲。《春秋傳》曰：‘天子因生以賜姓。’”', '《說文》：“姑，夫母也。从女，古聲。”', '《說文》：“曲，象器曲受物之形。或說，曲，蠶薄也。，古文曲。”', '《說文》：“素，白緻繒也。从糸、𠂹，取其澤也。”', '《說文》：“均，平，徧也。从土，从勻，勻亦聲。”', '《說文》：“葢，苫也。从艸，盇聲。”', '《說文》：“訊，問也。从言，卂聲。䛜，古文訊从卥。”', '《說文》：“警，戒也。从言，从敬，敬亦聲。”', '《說文》：“叜，老也。从又，从灾。闕。𡨎，籀文仌寸。𠋢，𡨎或从人。”', '《說文》：“胡，牛𩔞垂也。从肉，古聲。”', '《說文》：“箭，矢也。从竹，前聲。”', '《說文》：“豐，豆之豐滿者也。从豆，象形。一曰鄉飲酒有豐侯者。𧯮，古文豐。”', '《說文》：“植，戶植也。从木，直聲。㯰，或从置。”', '《說文》：“束，縛也。从囗、木。”', '《說文》：“剌，戾也。从束，从刀。刀者，剌之也。”', '《說文》：“鄰，五家為鄰。从邑，粦聲。”', '《說文》：“鄭，京兆縣。周厲王子友所封。从邑，奠聲。宗周之滅，鄭徙潧洧之上，今新鄭是也。”', '《說文》：“糧，穀也。从米，量聲。”', '《說文》：“寒，凍也。从人在宀下，以茻薦覆之，下有仌。”', '《說文》：“帖，帛書署也。从巾，占聲。”', '《說文》：“監，臨下也。从臥，䘓省聲。𧨭，古文監从言。”', '《說文》：“欺，詐欺也。从欠，其聲。”', '《說文》：“烈，火猛也。从火，𠛱聲。”', '《說文》：“灰，死火餘㶳也。从火，从又。又，手也。火既滅，可以執持。”', '《說文》：“惜，痛也。从心，昔聲。”', '《說文》：“忍，能也。从心，刃聲。”', '《說文》：“聖，通也。从耳，呈聲。”', '《說文》：“掌，手中也。从手，尚聲。”', '《說文》：“操，把持也。从手，喿聲。”', '《說文》：“按，下也。从手，安聲。”', '《說文》：“奴，奴、婢，皆古之辠人也。《周禮》曰：‘其奴，男子入于辠隸，女子入于舂藁。’从女，从又。㚢，古文奴，从人。”', '《說文》：“亡，逃也。从入，从𠃊。”', '《說文》：“納，絲溼納納也。从糸，內聲。”', '《說文》：“綠，帛青黃色也。从糸，彔聲。”', '《說文》：“緣，衣純也。从糸，彖聲。”', '《說文》：“壁，垣也。从土，辟聲。”', '《說文》：“協，眾之同和也。从劦，从十。旪，古文協，从曰、十。叶，或从口。”', '《說文》：“鎮，博壓也。从金，真聲。”', '《說文》：“載，乘也。从車，𢦒聲。”', '《說文》：“禁，吉凶之忌也。从示，林聲。”', '《說文》：“珠，蚌之陰精。从玉，朱聲。《春秋國語》曰：‘珠以禦火灾。’是也。”', '《說文》：“莫，日且冥也。从日在茻中。”', '《說文》：“含，嗛也。从口，今聲。”', '《說文》：“遣，縱也。从辵，𠳋聲。”', '《說文》：“遂，亡也。从辵，㒸聲。𨓸，古文遂。”', '《說文》：“牙，牡齒也。象上下相錯之形。𤘈，古文牙。”', '《說文》：“丈，十尺也。从又持十。”', '《說文》：“訓，說教也。从言，川聲。”', '《說文》：“謀，慮難曰謀。从言，某聲。𠰔古文謀，𧦥亦古文。”', '《說文》：“𣦃（剪），齊斷也。从刀，歬聲。”', '《說文》：“副，判也。从刀，畐聲。《周禮》曰：‘副辜祭。’疈，籀文副。”', '《說文》：“劃，錐刀曰劃。从刀，从畫，畫亦聲。”', '《說文》：“寧，願詞也。从丂，寍聲。”', '《說文》：“槃，承槃也。从木，般聲。鎜，古文，从金。盤，籀文，从皿。”', '《說文》：“㬥，晞也。从日，从出，从収，从米。𣋴，古文㬥。从日，麃聲。”', '《說文》：“宮，室也。从宀，躳省聲。”', '《說文》：“倫，輩也。从人，侖聲。一曰道也。”', '《說文》：“侵，漸進也。从人、又，持帚若埽之進。又，手也。”', '《說文》：“尾，微也。从到毛在尸後。古人或飾系尾，西南夷亦然。”', '《說文》：“顏，眉目之閒也。从頁，彥聲。𩕝，籀文。”', '《說文》：“吳，姓也，亦郡也。一曰吳，大言也。从夨、口。𡗾，古文如此。”', '《說文》：“波，水涌流也。从水，皮聲。”', '《說文》：“川，貫穿通流水也。《虞書》曰：‘濬𡿨巜距川’，言深𡿨巜之水會為川也。”', '《說文》：“孔，通也。从乙，从子。乙，請子之候鳥也。乙至而得子，嘉美之也。古人名嘉，字子孔。”', '《說文》：“陰，闇也。水之南，山之北也。从𨸏，侌聲。”', '《說文》：“隔，障也。从𨸏，鬲聲。”', '《說文》：“辛，秋時萬物成而孰。金剛味辛，辛痛即泣出。从一，从䇂。䇂，辠也。辛承庚，象人股。”', '《說文》：“辭，訟也。从𤔔，𤔔猶理辜也。𤔔，理也。𤔲，籀文辭从司。”', '《說文》：“配，酒色也。从酉，己聲。”', '《說文》：“祝，祭主贊詞者。从示，从人、口。一曰从兌省。《易》曰：‘兌，為口為巫。’”', '《說文》：“唉，譍也。从口，矣聲。”', '《說文》：“述，循也。从辵，朮聲。䢤，籀文从秫。”', '《說文》：“博，大，通也。从十，从尃。尃，布也。”', '《說文》：“詩，志也。从言，寺聲。𧥳，古文詩省。”', '《說文》：“魯，鈍詞也。从白，鮺省聲。《論語》曰：‘參也魯。’”', '《說文新附》：“翻，飛也。从羽，番聲。或从飛。”', '《說文》：“𡙜，手持隹失之也。从又，从㚝。”', '《說文》：“幼，少也。从幺，从力。”', '《說文》：“殘，賊也。从歺，戔聲。”', '《說文》：“脫，消肉臞也。从肉，兌聲。”', '《說文》：“牆，垣蔽也。从嗇，爿聲。𤖣，籀文从二禾；𤖧，籀文亦从二來。”', '《說文》：“模，法也。从木，莫聲。讀若嫫母之嫫。”', '《說文》：“夢，不明也。从夕，瞢省聲。”', '《說文》：“版，判也。从片，反聲。”', '《說文》：“移，禾相倚移也。从禾，多聲。一曰禾名。”', '《說文》：“罵，詈也。从网，馬聲。”', '《說文》：“仁，親也。从人，从二。忎，古文仁从千、心。𡰥，古文仁或从尸。”', '《說文》：“僅，材能也。从人，堇聲。”', '《說文》：“優，饒也。从人，憂聲。一曰倡也。”', '《說文》：“仔，克也。从人，子聲。”', '《說文》：“尼，從後近之。从尸，匕聲。”', '《說文》：“層，重屋也。从尸，曾聲。”', '《說文》：“欲，貪欲也。从欠，谷聲。”', '《說文新附》：“彩，文章也。从彡，采聲。”', '《說文》：“奏，奏進也。从夲，从𠬞，从屮；屮，上進之義。𡲯，古文。𢽥，亦古文。”', '《說文》：“愁，憂也。从心，秋聲。”', '《說文》：“浪，滄浪水也。南入江。从水，良聲。”', '《說文》：“滑，利也。从水，骨聲。”', '《說文》：“津，水渡也。从水，𦘔聲。𦪉，古文𣸁从舟，从淮。”', '《說文》：“渡，濟也。从水，度聲。”', '《說文》：“減，損也。从水，咸聲。”', '《說文》：“零，餘雨也。从雨，令聲。”', '《說文》：“勤，勞也。从力，堇聲。”', '《說文》：“降，下也。从𨸏，夅聲。”', '《說文》：“乙，象春艸木冤曲而出，陰氣尚彊，其出乙乙也。與丨同意，乙承甲，象人頸。”', '《說文》：“𢍜，酒器也。从酋，廾以奉之。《周禮》六尊：犧尊、象尊、著尊、壺尊、太尊、山尊，以待祭祀賓客之禮。尊，或从寸。”', '《說文》：“贊，見也。从貝，从兟。”', '《說文》：“茲，艸木多益。从艸，茲省聲。”', '《說文》：“唐，大言也。从口，庚聲。𠴭，古文唐，从口、昜。”', '《說文新附》：“喚，呼也。从口，奐聲。古通用奐。”', '《說文》：“乏，《春秋傳》曰：‘反正為乏。’”', '《說文》：“追，逐也。从辵，𠂤聲。”', '《說文》：“冊，符命也，諸矦進受于王也。象其札一長一短，中有二編之形。笧，古文𠕋从竹。”', '《說文》：“誠，信也。从言，成聲。”', '《說文》：“堅，剛也。从臤，从土。”', '《說文》：“寸，十分也。人手卻一寸動𧖴，謂之寸口。从又，从一。”', '《說文》：“牧，養牛人也。从攴，从牛。《詩》曰：‘牧人乃夢。’”', '《說文》：“𥏼，識詞也。从白，从亏，从知。𥏾，古文𥏼。”', '《說文》：“奮，翬也。从㚝在田上。《詩》曰：‘不能奮飛。’”', '《說文》：“烏，孝鳥也。象形。孔子曰：‘烏，𥃳呼也。’取其助气，故以為烏呼。𤚶，古文烏，象形。於，象古文烏省。”', '《說文》：“巧，技也。从工，丂聲。”', '《說文》：“巨，規巨也。从工，象手持之。榘，巨或从木、矢，矢者，其中正也。𢀑，古文巨。”', '《說文》：“缾，𦉥也。从缶，并聲。瓶，缾或从瓦。”', '《說文》：“桃，果也。从木，兆聲。”', '《說文》：“榮，桐木也。从木，熒省聲。一曰屋梠之兩頭起者為榮。”', '《說文》：“郵，境上行書舍。从邑、垂。垂，邊也。”', '《說文》：“冒，冡而前也。从冃，从目。𡈘，古文冒。”', '《說文》：“佛，見不審也。从人，弗聲。”', '《說文》：“煩，熱頭痛也。从頁，从火。一曰焚省聲。”', '《說文》：“胞，兒生裹也。从肉，从包。”', '《說文》：“淺，不深也。从水，戔聲。”', '《說文》：“液，𧗁也。从水，夜聲。”', '《說文》：“汗，人液也。从水，干聲。”', '《說文》：“𣻣，徒行厲水也。从沝，从步。涉，篆文从水。”', '《說文》：“靁，陰陽薄動，靁雨生物者也，从雨，畾象回轉形。𩂩，古文靁。𤴐，古文靁。𩇓，籀文，靁間有回，回，靁聲也。”', '《說文》：“閱，具數於門中也。从門，說省聲。”', '《說文》：“姊，女兄也。从女，𠂔聲。”', '《說文》：“或，邦也。从囗，从戈以守一。一，地也。域，或又从土。”', '《說文》：“紛，馬尾韜也。从糸，分聲。”', '《說文》：“蠶，任絲也。从䖵，朁聲。”', '《說文》：“塞，隔也。从土，从𡨄。”', '《說文》：“輸，委輸也。从車，俞聲。”', '《說文》：“荷，芙蕖葉。从艸，何聲。”', '《說文》：“避，回也。从辵，辟聲。”', '《說文》：“𧘂，通道也。从行，童聲。《春秋傳》曰：‘及𧘂以戈擊之。’”', '《說文》：“干，犯也。从反入，从一。”', '《說文》：“謂，報也。从言，胃聲。”', '《說文》：“訪，汎謀曰訪。从言，方聲。”', '《說文》：“戴，分物得增益曰戴。从異，𢦒聲。”', '《說文》：“臣，牽也，事君也。象屈服之形。”', '《說文》：“策，馬箠也。从竹，朿聲。”', '《說文》：“豆，古食肉器也。从口，象形。𣅣，古文豆。”', '《說文》：“松，木也。从木，公聲。㮤，松或从容。”', '《說文》：“柴，小木散材。从木，此聲。”', '《說文》：“賞，賜有功也。从貝，尚聲。”', '《說文》：“貧，財分少也。从貝，从分，分亦聲。𡧋，古文从宀、分。”', '《說文》：“暫，不久也。从日，斬聲。”', '《說文》：“瓜，㼌也。象形。”', '《說文》：“伊，殷聖人阿衡，尹治天下者。从人，从尹。”', '《說文》：“偉，奇也。从人，韋聲。”', '《說文》：“欠，張口气悟也。象气从人上出之形。”', '《說文》：“狐，䄏獸也，鬼所乘之。有三德：其色中和，小前大後，死則丘首。从犬，瓜聲。”', '《說文》：“忠，敬也。从心，中聲。”', '《說文》：“惟，凡思也。从心，隹聲。”', '《說文》：“淡，薄味也。从水，炎聲。”', '《說文》：“揚，飛舉也。从手，易聲。𠭲，古文。”', '《說文》：“振，舉救也。从手，辰聲。一曰奮也。”', '《說文》：“損，減也。从手，員聲。”', '《說文》：“拾，掇也。从手，合聲。”', '《說文》：“𢲘，遠取之也。从手，𥥍聲。”', '《說文》：“系，繫也。从糸，丿聲。𣫦，系或从𣪠、處。𦃟，籀文系从爪、絲。”', '《說文》：“率，捕鳥畢也。象絲罔。上下其竿柄也。”', '《說文》：“𧖅，蠭甘飴也。一曰螟子。从䖵，鼏聲。蜜，𧖅或从宓。”', '《說文》：“蠅，營營青蠅，蟲之大腹者。从黽，从虫。”', '《說文》：“荒，蕪也。从艸，巟聲。一曰艸淹地也。”', '《說文》：“逐，追也。从辵，从豚省。”', '《說文》：“詳，審議也。从言，羊聲。”', '《說文》：“誤，謬也。从言，吳聲。”', '《說文》：“割，剝也。从刀，害聲。”', '《說文》：“刷，刮也。从刀，㕞省聲。《禮》：‘布刷巾。’”', '《說文》：“耕，犂也。从耒，井聲。一曰古者井田。”', '《說文》：“于，於也。象气之舒于。从丂，从一。一者，其气平之也。”', '《說文》：“虧，气損也。从亏，雐聲。𧇾，虧或从兮。”', '《說文》：“餅，麪餈也。从食，并聲。”', '《說文》：“郎，魯亭也。从邑，良聲。”', '《說文》：“稻，稌也。从禾，舀聲。”', '《說文》：“疾，病也。从疒，矢聲。𤶅，古文疾。𥏦，籀文疾。”', '《說文》：“僑，高也。从人，喬聲。”', '《說文》：“侮，傷也。从人，每聲。㑄，古文从母。”', '《說文新附》：“債，債負也。从人、責，責亦聲。”', '《說文》：“允，信也。从儿，㠯聲。”', '《說文》：“覽，觀也。从見、監，監亦聲。”', '《說文》：“兔，獸名。象踞，後其尾形，兔頭與㲋頭同。”', '《說文》：“獵，放獵逐禽也。从犬，巤聲。”', '《說文》：“烖，天火曰烖。从火，𢦏聲。灾，或从宀、火；𤆎，古文从才；災，籀文从𡿧。”', '《說文》：“奔，走也。从夭，賁省聲。與走同意，俱从夭。”', '《說文》：“慈，愛也。从心，茲聲。”', '《說文》：“懷，念思也。从心，褱聲。”', '《說文》：“泰，滑也。从廾，从水，大聲。夳，古文泰。”', '《說文》：“𧖴，血理分衺行體者，从𠂢从血。脈，𧖴或从肉。衇，籀文。”', '《說文》：“閉，闔門也。从門，才所以距門也。”', '《說文》：“播，穜也。一曰布也。从手，番聲。𢿥，古文播。”', '《說文》：“繩，索也。从糸，蠅省聲。”', '《說文》：“蟁，齧人飛蟲。从䖵，民聲。𧓹，蟁或从昬，以昬時出也。蚊，俗蟁。从虫，从文。”', '《說文》：“鉛，青金也。从金，㕣聲。”', '《說文》：“錄，金色也。从金，彔聲。”', '《說文》：“禍，害也，神不福也。从示，咼聲。”', '《說文》：“介，畫也。从八，从人。人各有介。”', '《說文》：“吾，我自稱也。从口，五聲。”', '《說文》：“遲，徐行也。从辵，犀聲。《詩》曰：‘行道遲遲。’𨒈，遲或从𡰥。遟，籀文遲从屖。”', '《說文》：“競，彊語也。一曰逐也。从誩，从二人。”', '《說文》：“占，視兆問也。从卜，从口。”', '《說文》：“督，察也。一曰目痛也。从目，叔聲。”', '《說文》：“鼻，引气自畀也。从自、畀。”', '《說文》：“股，髀也。从肉，殳聲。”', '《說文新附》：“劇，尤甚也。从刀，未詳，豦聲。”', '《說文》：“井，八家一井。象構韓形。‧，𦉥之象也。古者伯益初作井。”', '《說文》：“餓，飢也。从食，我聲。”', '《說文》：“缺，器破也。从缶，決省聲。”', '《說文》：“亯，獻也。从高省。曰：象進孰物形。《孝經》曰：‘祭則鬼亯之。’享，篆文亯。”', '《說文》：“索，艸有莖葉可作繩索。从𣎵糸。杜林說：𣎵，亦朱𣎵字。”', '《說文》：“貝，海介蟲也。居陸名猋，在水名蜬。象形。古者貨貝而寶龜，周而有泉，至秦廢貝行錢。”', '《說文》：“秀，上諱。”', '《說文》：“宦，仕也。从宀，从臣。”', '《說文》：“突，犬从穴中暫出也。从犬在穴中。一曰滑也。”', '《說文》：“虛，大丘也。崐崘丘謂之崐崘虛，古者九夫為井，四井為邑，四邑為丘，丘謂之虛。从丘，虍聲。”', '《說文》：“犯，侵也。从犬，巳聲。”', '《說文》：“獲，獵所獲也。从犬，蒦聲。”', '《說文》：“執，捕罪人也。从丮，从㚔，㚔亦聲。”', '《說文》：“憲，敏也。从心，从目，害省聲。”', '《說文》：“恭，肅也。从心，共聲。”', '《說文》：“染，以繒染為色。从水，杂聲。”', '《說文》：“𩼪，捕魚也。从𩺰，从水。漁，篆文𩼪从魚。”', '《說文》：“扇，扉也。从戶，从翄聲。”', '《說文》：“揮，奮也。从手，軍聲。”', '《說文》：“𧵪，敗也。从戈，則聲。”', '《說文》：“珍，寶也。从玉，㐱聲。”', '《說文》：“吉，善也。从士、口。”', '《說文》：“徐，安行也。从彳，余聲。”', '《說文》：“延，長行也。从㢟，丿聲。”', '《說文》：“諒，信也。从言，京聲。”', '《說文》：“譯，傳譯四夷之言者。从言，睪聲。”', '《說文》：“雅，楚烏也。一名鸒，一名卑居，秦謂之雅。从隹，牙聲。”', '《說文》：“觸，抵也。从角，蜀聲。”', '《說文》：“籍，簿書也。从竹，耤聲。”', '《說文》：“筒，通簫也。从竹，同聲。”', '《說文》：“舍，市居曰舍。从亼、屮，象屋也。口象築也。”', '《說文》：“森，木多皃。从林，从木。讀若曾參之參。”', '《說文》：“穀，續也，百穀之緫名。从禾，𣪊聲。”', '《說文》：“宜，所安也。从宀之下，一之上，多省聲。𡪀，古文宜。𡨆，亦古文宜。”', '《說文》：“覆，覂也。一曰蓋也。从襾，復聲。”', '《說文》：“仰，舉也。从人，从卬。”', '《說文》：“盜，私利物也。从㳄，㳄欲皿者。”', '《說文》：“猛，健犬也。从犬，孟聲。”', '《說文》：“獻，宗廟犬名羹獻，犬肥者以獻之。从犬，鬳聲。”', '《說文》：“恥，辱也。从心，耳聲。”', '《說文》：“涼，薄也。从水，京聲。”', '《說文》：“燕，玄鳥也。籋口，布翄，枝尾，象形。”', '《說文》：“援，引也。从手，爰聲。”', '《說文》：“㩅，引也。从手，畱聲。抽，㩅或从由。𢭆，㩅或从秀。”', '《說文》：“捕，取也。从手，甫聲。”', '《說文》：“捐，棄也。从手，肙聲。”', '《說文》：“墨，書墨也。从土，从黑，黑亦聲。”', '《說文》：“斤，斫木也。象形。”', '《說文》：“孤，無父也。从子，瓜聲。”', '《說文》：“申，神也。七月，陰气成，體自申束。从臼，自持也。吏臣餔時聽事，申旦政也。𤱓，古文申。𢑚，籀文申。”', '《說文》：“折，斷也。从斤斷艸，譚長說。𣂲，籀文折，从艸在仌中，仌寒，故折。𣂚，篆文折，从手。”', '《說文》：“吐，寫也。从口，土聲。”', '《說文》：“𨑡，步行也。从辵，土聲。”', '《說文新附》：“透，跳也；過也。从辵，秀聲。”', '《說文》：“肅，持事振敬也。从𦘒在𣶒上，戰戰兢兢也。𦘡，古文肅。从心，从卪。”', '《說文》：“雀，依人小鳥也。从小、隹。讀與爵同。”', '《說文》：“判，分也。从刀，半聲。”', '《說文》：“典，五帝之書也。从𠕋在丌上，尊閣之也。莊都說：“典，大𠕋也。’𥮏，古文典从竹。”', '《說文》：“旨，美也。从甘，匕聲。𣅌，古文旨。”', '《說文》：“盆，盎也。从皿，分聲。”', '《說文》：“矣，語已詞也。从矢，以聲。”', '《說文》：“憂，和之行也。从夊，𢚧聲。《詩》曰：‘布政憂憂。’”', '《說文》：“楊，木也。从木，昜聲。”', '《說文》：“𣠙，木杪末也，从木𤐫聲。”', '《說文》：“昌，美言也。从日，从曰。一曰日光也。《詩》曰：‘東方昌矣。’𣅊，籀文昌。”', '《說文》：“租，田賦也。从禾，且聲。”', '《說文》：“宋，居也。从宀，从木。”', '《說文》：“錦，襄邑織文。从帛，金聲。”', '《說文》：“伴，大皃。从人，半聲。”', '《說文》：“鬼，人所歸為鬼。从人，象鬼頭。鬼陰氣賊害，从厶。𩲚，古文从示。”', '《說文》：“㺅，夔也。从犬，矦聲。”', '《說文》：“慰，安也。从心，尉聲。一曰恚怒也。”', '《說文》：“悲，痛也。从心，非聲。”', '《說文》：“混，豐流也。从水，昆聲。”', '《說文》：“雲，山川气也。从雨，云象雲回轉形。云，古文省雨。，亦古文雲。”', '《說文》：“撲，挨也。从手，菐聲。”', '《說文》：“姻，壻家也，女之所因，故曰姻。从女，从因，因亦聲。婣，籀文姻从𣶒。”', '《說文》：“縱，緩也。一曰舍也。从糸，從聲。”', '《說文》：“䋣，馬髦飾也。从糸，每聲。《春秋傳》曰：‘可以稱旌䋣乎。’䋣或从𢍍。𢍍，籀文弁。”', '《說文》：“它，虫也。从虫而長，象冤曲垂尾形。上古艸居患它，故相問無它乎。蛇，它或从虫。”', '《說文》：“丁，夏時萬物皆丁實。象形。丁承丙，象人心。”', '《說文》：“壯，大也，从士，爿聲。”', '《說文》：“蒼，艸色也。从艸，倉聲。”', '《說文》：“趁，𧾍也。从走，㐱聲。讀若塵。”', '《說文》：“跌，踼也。从足，失聲。一曰越也。”', '《說文》：“翁，頸毛也。从羽，公聲。”', '《說文新附》：“鴨，鶩也。俗謂之鴨。从鳥，甲聲。”', '《說文》：“膠，昵也，作之以皮。从肉，翏聲。”', '《說文》：“籠，舉土器也。一曰笭也。从竹，龍聲。”', '《說文》：“椅，梓也。从木，奇聲。”', '《說文》：“圈，養畜之閑也。从囗，卷聲。”', '《說文》：“賀，以禮相奉慶也。从貝，加聲。”', '《說文新附》：“貼，以物為質也。从貝，占聲。”', '《說文》：“稍，出物有漸也。从禾，肖聲。”', '《說文》：“裁，制衣也。从衣，𢦒聲。”', '《說文新附》：“艇，小舟也。从舟，廷聲。”', '《說文》：“騎，跨馬也。从馬，奇聲。”', '《說文》：“悟，覺也。从心，吾聲。𢛤，古文悟。”', '《說文》：“悶，懣也。从心，門聲。”', '《說文》：“患，憂也。从心，上貫吅，吅亦聲。𨴮，古文从關省。𢤒，亦古文患。”', '《說文》：“扶，左也。从手，夫聲。𢻳，古文扶。”', '《說文》：“擇，柬選也。从手，睪聲。”', '《說文》：“𢬸，絜也。从手，𠯑聲。”', '《說文》：“媿，慙也。从女，鬼聲。愧，媿或从恥省。”', '《說文》：“琴，禁也。神農所作。洞越，練朱五弦，周加二弦。象形。”', '《說文》：“繞，纏也。从糸，堯聲。”', '《說文新附》：“塗，泥也。从土，涂聲。”', '《說文》：“釘，鍊鉼黄金。从金，丁聲。”', '《說文》：“輩，若軍發車百兩為一輩。从車，非聲。”', '《說文》：“阻，險也。从𨸏，且聲。”', '《說文》：“苗，艸生於田者。从艸，从田。”', '《說文》：“嘆，吞歎也。从口，歎省聲。一曰太息也。”', '《說文》：“廷，朝中也。从廴，𡈼聲。”', '《說文》：“齒，口齗骨也。象口齒之形。止聲。𠚒，古文齒字。”', '《說文》：“戒，警也。从廾持戈，以戒不虞。”', '《說文》：“膽，連肝之府。从肉，詹聲。”', '《說文》：“曰，詞也。从口，乙聲，亦象口气出也。”', '《說文》：“嘗，口味之也。从旨，尚聲。”', '《說文》：“桂，江南木，百藥之長。从木，圭聲。”', '《說文》：“枇，枇杷，木也。从木，比聲。”', '《說文》：“柏，鞠也。从木，白聲。”', '《說文》：“暑，熱也。从日，者聲。”', '《說文新附》：“曆，厤象也。从日，厤聲。《史記》通用歷。”', '《說文》：“圅，舌也。象形，舌體𢎘𢎘。从𢎘，𢎘亦聲。肣，俗圅从肉、今。”', '《說文》：“粗，疏也。从米，且聲。”', '《說文》：“网，庖犧所結繩以漁。从冂，下象网交文。𦉸，网或从亡；𦋟，网或从糸；𠕃，古文网；𦉯，籀文网。”', '《說文》：“倍，反也。从人，咅聲。”', '《說文》：“偏，頗也。从人，扁聲。”', '《說文》：“倡，樂也。从人，昌聲。”', '《說文》：“仇，讎也。从人，九聲。”', '《說文》：“聚，會也。从㐺，取聲。邑落云聚。”', '《說文新附》：“屢，數也。按今之婁字本是屢空字，此字後人所加，从尸未詳。”', '《說文》：“駐，馬立也。从馬，主聲。”', '《說文》：“猜，恨賊也。从犬，青聲。”', '《說文》：“狼，似犬，銳頭，白頰，高前，廣後。从犬，良聲。”', '《說文》：“慘，毒也。从心，參聲。”', '《說文新附》：“恰，用心也。从心，合聲。”', '《說文》：“濕，水。出東郡東武陽，入海。从水，㬎聲。桑欽云：出平原高唐。”', '《說文》：“洪，洚水也。从水，共聲。”', '《說文》：“汪，深廣也。从水，𡉚聲。一曰汪，池也。”', '《說文》：“握，搤持也。从手，屋聲。𦥆，古文握。”', '《說文》：“妨，害也。从女，方聲。”', '《說文》：“妄，亂也。从女，亡聲。”', '《說文》：“階，陛也。从𨸏，皆聲。”', '《說文》：“酸，酢也。从酉，夋聲。關東謂酢曰酸。𨢽，籀文酸从畯。”', '《說文》：“宷，悉也，知宷諦也。从宀，从釆。審，篆文宷从番。”', '《說文》：“釋，解也。从釆，釆，取其分別物也。从睪聲。”', '《說文》：“召，𧦝也。从口，刀聲。”', '《說文》：“趙，趨趙也。从走，肖聲。”', '《說文》：“遭，遇也。从辵，曹聲。一曰邐行。”', '《說文》：“劒，人所帶兵也。从刃，僉聲。劍，籀文劒从刀。”', '《說文》：“箱，大車牝服也。从竹，相聲。”', '《說文》：“梧，梧桐木。从木，吾聲。一名櫬。”', '《說文》：“構，蓋也。从木，冓聲。杜林以為椽桷字。”', '《說文》：“賢，多才也。从貝，臤聲。”', '《說文》：“寬，屋寬大也。从宀，萈聲。”', '《說文》：“竂，穿也。从穴，尞聲。”', '《說文》：“伐，擊也。从人持戈。一曰敗也。”', '《說文》：“孝，善事父母者。从老省，从子，子承老也。”', '《說文》：“皃，頌儀也。从人，白象人面形。䫉，皃或从頁，豹省聲。貌，籀文皃，从豹省。”', '《說文》：“頑，㮯頭也。从頁，元聲。”', '《說文》：“廉，仄也。从广，兼聲。”', '《說文》：“勿，州里所建旗。象其柄，有三游。雜帛，幅半異。所以趣民，故遽稱勿勿。𣃦，勿或从㫃。”', '《說文》：“鹿，獸也。象頭角四足之形。鳥、鹿足相似，从匕。”', '《說文》：“恩，惠也。从心，因聲。”', '《說文》：“潛，涉水也。一曰藏也。一曰漢水為潛。从水，朁聲。”', '《說文》：“漏，以銅受水刻節，晝夜百刻。从水，屚聲。”', '《說文》：“泉，水原也。象水流出成川形。”', '《說文》：“插，刺肉也。从手，从臿。”', '《說文》：“撥，治也。从手，發聲。”', '《說文》：“技，巧也。从手，支聲。”', '《說文》：“娶，取婦也。从女，从取，取亦聲。”', '《說文》：“瓦，土器已燒之總名。象形。”', '《說文》：“卵，凡物無乳者卵生。象形。”', '《說文》：“畜，田畜也。《淮南子》曰：‘玄田為畜。𤲸，’《魯郊禮》畜从田、从茲。茲，益也。”', '《說文》：“𦥶，母之兄弟為𦥶，妻之父為外𦥶。从男，臼聲。”', '《說文》：“辱，耻也。从寸在辰下。失耕時，於封畺上戮之也。辰者，農之時也。故房星為辰，田候也。”', '《說文》：“蔣，苽蔣也。从艸，將聲。”', '《說文》：“蓄，積也。从艸，畜聲。”', '《說文》：“牲，牛完全。从牛，生聲。”', '《說文》：“喪，亡也。从哭，从亡，會意。亡亦聲。”', '《說文》：“迷，或也。从辵，米聲。”', '《說文》：“託，寄也。从言，乇聲。”', '《說文》：“鳴，鳥聲也。从鳥，从口。”', '《說文》：“棄，捐也。从廾推𠦒棄之，从𠫓，𠫓，逆子也。弃，古文棄。”', '《說文》：“飽，猒也。从食，包聲。𩜿，古文飽，从𤓽。𩛁，亦古文飽，从卯聲。”', '《說文新附》：“矮，短人也。从矢，委聲。”', '《說文》：“朵，樹木垂朵朵也。从木，象形。此與采同意。”', '《說文》：“旋，周旋，旌旗之指麾也。从㫃，从疋。”', '《說文》：“貫，錢貝之貫。从毌、貝。”', '《說文》：“㝛，止也。从宀，𠈇聲。𠈇，古文夙。”', '《說文》：“佩，大帶佩也。从人，从凡，从巾。佩必有巾，巾謂之飾。”', '《說文》：“俱，偕也。从人，具聲。”', '《說文》：“臥，休也。从人、臣，取其伏也。”', '《說文》：“複，重衣也。从衣，复聲。一曰褚衣。”', '《說文》：“匈，聲也。从勹，凶聲。𦙄，匈或从肉。”', '《說文》：“耏，罪不至髡也。从而，从彡。耐，或从寸。諸法度字从寸。”', '《說文》：“駕，馬在軛中。从馬，加聲。𤙑，籀文駕。”', '《說文》：“默，犬暫逐人也。从犬，黑聲。讀若墨。”', '《說文》：“爤，孰也。从火，蘭聲。燗，或从閒。”', '《說文》：“赤，南方色也。从大、从火。烾，古文从炎、土。”', '《說文》：“慕，習也。从心，莫聲。”', '《說文》：“浙，江水東至會稽山陰為浙江。从水，折聲。”', '《說文》：“蕩，水。出河內蕩陰，東入黃澤。从水，𦳝聲。”', '《說文》：“闖，馬出門皃。从馬在門中。讀若郴。”', '《說文》：“緜，聯微也。从糸，从帛。”', '《說文》：“縮，亂也。从糸，宿聲。一曰蹴也。”', '《說文》：“勉，彊也。从力，免聲。”', '《說文》：“銷，鑠金也。从金，肖聲。”', '《說文》：“鈔，叉取也。从金，少聲。”', '《說文》：“陷，高下也。一曰陊也。从𨸏，从臽，臽亦聲。”', '《說文》：“呈，平也。从口，𡈼聲。”', '《說文新附》：“售，賣去手也。从口，雔省聲。”', '《說文》：“超，跳也。从走，召聲。”', '《說文》：“遷，登也。从辵，𠨧聲。拪，古文遷从手、西。”', '《說文》：“譬，諭也。从言，辟聲。”', '《說文》：“謹，慎也。从言，堇聲。”', '《說文》：“僕，給事者。从人，从菐，菐亦聲。䑑，古文从臣。”', '《說文》：“勒，馬頭絡銜也。从革，力聲。”', '《說文》：“融，炊气上出也。从鬲，蟲省聲。籀文融不省。”', '《說文》：“䰞，孚也。从䰜，者聲。煮，䰞或从火；䰞，䰞或从水在其中。”', '《說文》：“𨿳，鳥也。从隹，瘖省聲。或从人，人亦聲。𪇿，籀文𨿳从鳥。”', '《說文》：“䳘，鴚鵝也。从鳥，我聲。”', '《說文》：“惠，仁也。从心，从叀。𢡘，古文惠从芔。”', '《說文》：“予，推予也。象相予之形。”', '《說文》：“朱，赤心木，松柏屬。从木，一在其中。”', '《說文》：“贈，玩好相送也。从貝，曾聲。”', '《說文》：“兇，擾恐也，从人在凶下。”', '《說文》：“帳，張也。从巾，長聲。”', '《說文》：“儲，偫也。从人，諸聲。”', '《說文》：“壽，久也。从老省，𠷎聲。”', '《說文》：“碎，䃺也。从石，卒聲。”', '《說文》：“狂，狾犬也。从犬，㞷聲。忹，古文从心。”', '《說文》：“炭，燒木餘也。从火，岸省聲。”', '《說文》：“閣，所以止扉也。从門，各聲。”', '《說文》：“閃，闚頭門中也。从人在門中。”', '《說文》：“拔，擢也。从手，犮聲。”', '《說文》：“匠，木工也。从匚，从斤。斤，所以作器也。”', '《說文》：“緒，絲耑也。从糸，者聲。”', '《說文》：“紹，繼也。从糸，召聲。一曰紹緊糾也。綤，古文紹从邵。”', '《說文》：“斗，十升也。象形，有柄。”', '《說文》：“轉，運也。从車，專聲。”', '《說文》：“藉，祭藉也。一曰：艸不編，狼藉。从艸，耤聲。”', '《說文》：“薪，蕘也。从艸，新聲。”', '《說文》：“遮，遏也。从辵，庶聲。”', '《說文》：“徑，步道也。从彳，巠聲。”', '《說文》：“譽，也。从言，與聲。”', '《說文》：“役，戍邊也。从殳，从彳。𠈧，古文役从人。”', '《說文》：“臚，皮也。从肉，盧聲。膚，籀文臚。”', '《說文》：“臂，手上也。从肉，辟聲。”', '《說文》：“罰，辠之小者。从刀，从詈。未以刀有所賊，但持刀罵詈則應罰。”', '《說文》：“柳，小楊也。从木，丣聲。丣，古文酉。”', '《說文》：“柔，木曲直也。从木，矛聲。”', '《說文》：“𨼇，豐大也。从生，降聲。”', '《說文》：“貢，獻功也。从貝，工聲。”', '《說文》：“貪，欲物也。从貝，今聲。”', '《說文》：“啚，嗇也。从囗、㐭。㐭，受也。𠴿，古文啚如此。”', '《說文》：“㬜，進也，日出萬物進。从日，从臸。”', '《說文》：“昏，日冥也。从日，氐省。氐者，下也。一曰民聲。”', '《說文》：“旱，不雨也。从日，干聲。”', '《說文》：“曬，㬥也。从日，麗聲。”', '《說文》：“常，下帬也。从巾，尚聲。裳，常或从衣。”', '《說文》：“飾，㕞也。从巾、从人，食聲。一曰襐飾。”', '《說文》：“偽，詐也。从人，為聲。”', '《說文》：“促，迫也。从人，足聲。”', '《說文》：“頗，頭偏也。从頁，皮聲。”', '《說文》：“厭，笮也。从厂，猒聲。一曰：合也。”', '《說文》：“熊，獸，似豕，山居，冬蟄。从能，炎省聲。”', '《說文》：“夾，持也。从大，俠二人。”', '《說文》：“慙，媿也。从心，斬聲。”', '《說文》：“湯，熱水也。从水，昜聲。”', '《說文》：“震，劈歷振物者。从雨，辰聲。《春秋傳》曰：‘震夷伯之廟。’ 𩇒，籀文震。”', '《說文》：“乳，人及鳥生子曰乳，獸曰產。从孚，从乙。乙者，玄鳥也。《明堂》、《月令》：‘玄鳥至之日，祠于高禖以請子。’故乳从乙。請子必以乙至之日者，乙春分來，秋分去，開生之候鳥，帝少昊司分之官也。”', '《說文》：“閒，隟也。从門，从月。𨳿，古文閒。”', '《說文》：“嫁，女適人也。从女，家聲。”', '《說文》：“戚，戉也。从戉，尗聲。”', '《說文》：“飄，回風也。从風，䙳聲。”', '《說文》：“獸，守備者。从嘼，从犬。”', '《說文》：“葛，絺綌艸也。从艸，曷聲。”', '《說文》：“菌，地蕈也。从艸，囷聲。”', '《說文》：“牽，引前也。从牛，象引牛之縻也，玄聲。”', '《說文》：“迪，道也。从辵，由聲。”', '《說文》：“返，還也。从辵，从反，反亦聲。《商書》曰：‘祖甲返。’𢓉，《春秋傳》返从彳。”', '《說文》：“隸，附箸也。从隶，柰聲。𨾀，篆文隸从古文之體。”', '《說文》：“敍，次弟也。从攴，余聲。”', '《說文》：“羽，鳥長毛也。象形。”', '《說文》：“籌，壺矢也。从竹，壽聲。”', '《說文》：“核，蠻夷以木皮為篋，狀如籨尊。从木，亥聲。”', '《說文》：“賜，予也。从貝，易聲。”', '《說文》：“兼，并也。从又持秝。兼，持二禾。秉，持一禾。”', '《說文》：“粒，糂也。从米，立聲。”', '《說文》：“躳，身也。从身，从呂。躬，躳或从弓。”', '《說文》：“巾，佩巾也。从冂，丨象系也。”', '《說文》：“企，舉踵也。从人，止聲。𠈮，古文企从足。”', '《說文》：“屈，無尾也。从尾，出聲。”', '《說文》：“卷，厀曲也。从卪，聲。”', '《說文》：“廚，庖屋也。从广，尌聲。”', '《說文》：“廟，尊先祖皃也。从广，朝聲。庿，古文。”', '《說文》：“猶，玃屬。从犬，酋聲。一曰隴西謂犬子為猷。”', '《說文》：“慮，謀思也。从思，虍聲。”', '《說文》：“愚，戇也。从心，从禺。禺，猴屬，獸之愚者。”', '《說文》：“漆，水。出右扶風杜陵岐山，東入渭。一曰入洛。从水，桼聲。”', '《說文》：“浮，氾也。从水，孚聲。”', '《說文》：“谷，泉出通川為谷。从水半見，出於口。”', '《說文》：“闢，開也。从門，辟聲。𨴔，《虞書》曰：‘闢四門’，从門，从廾。”', '《說文》：“純，絲也。从糸，屯聲。《論語》曰：‘今也純儉。’”', '《說文》：“綢，繆也。从糸，周聲。”', '《說文》：“𦅻，繛也。从素，爰聲。緩，𦅻或省。”', '《說文》：“培，培墩，土田山川也。从土，咅聲。”', '《說文》：“鑽，所以穿也。从金，贊聲。”', '《說文》：“鈴，令丁也。从金，从令，令亦聲。”', '《說文》：“吏，治人者也。从一，从史，史亦聲。”', '《說文》：“蒸，析麻中榦也。从艸，烝聲。䒱，蒸或省火。”', '《說文》：“叛，半也。从半，反聲。”', '《說文》：“牢，閑，養牛馬圈也。从牛，冬省，取其四周帀也。”', '《說文》：“哀，閔也。从口，衣聲。”', '《說文》：“效，象也。从攴，交聲。”', '《說文》：“貞，卜問也。从卜，貝以為贄。一曰鼎省聲，京房所說。”', '《說文》：“眉，目上毛也。从目，象眉之形，上象頟理也。”', '《說文》：“祈，求福也。从示，斤聲。”', '《說文》：“巡，延行皃。从辵，川聲。”', '《說文》：“𨒌，正行也。从辵，正聲。征，𨒌或从彳。”', '《說文》：“逢，遇也。从辵，峯省聲。”', '《說文》：“違，離也。从辵，韋聲。”', '《說文》：“遼，遠也。从辵，尞聲。”', '《說文新附》：“逼，近也。从辵，畐聲。”', '《說文》：“嗣，諸侯嗣國也。从𠕋，从口，司聲，孠，古文嗣从子。”', '《說文》：“鞠，踏鞠也。从革，匊聲。𩍸，鞠或从䉅。”', '《說文》：“敲，橫擿也。从攴，高聲。”', '《說文》：“殖，脂膏久，殖也。从歺，直聲。”', '《說文》：“腹，厚也。从肉，复聲。”', '《說文》：“腐，爛也。从肉，府聲。”', '《說文》：“刊，剟也。从刀，干聲。”', '《說文》：“籃，大篝也。从竹，監聲。𢉧，古文籃如此。”', '《說文》：“粵，亏也。審慎之詞者。从亏，从宷。《周書》曰：‘粵三日丁亥。’”', '《說文》：“餐，吞也。从食，𣦼聲。湌，餐或从水。”', '《說文》：“飢，餓也。从食，几聲。”', '《說文》：“𩏑，井垣也。从韋，取其帀也，倝聲。”', '《說文》：“栽，築牆長版也。从木，𢦒聲。《春秋傳》曰：‘楚圍蔡，里而栽。’”', '《說文》：“樓，重屋也。从木，婁聲。”', '《說文》：“檢，書署也。从木，僉聲。”', '《說文新附》：“賭，博簺也。从貝，者聲。”', '《說文新附》：“穩，蹂穀聚也。一曰安也。从禾，隱省。古通用安隱。”', '《說文》：“𤸃，臞也。从疒，叜聲。”', '《說文》：“冠，絭也。所以絭髮，弁冕之總名也。从冖，从元，元亦聲。冠有法制，从寸。”', '《說文》：“署，部署，有所网屬。从网，者聲。”', '《說文》：“幣，帛也。从巾，敝聲。”', '《說文》：“褎，袂也。从衣，𥝩聲。袖，俗褎从由。”', '《說文》：“顆，小頭也。从頁，果聲。”', '《說文新附》：“嶼，㠀也。从山，與聲。”', '《說文新附》：“嶺，山道也。从山，領聲。”', '《說文》：“驕，馬高六尺為驕。从馬，喬聲。《詩》曰：‘我馬唯驕。’一曰野馬。”', '《說文》：“慎，謹也。从心，真聲。昚，古文。”', '《說文》：“悔，悔恨也。从心，每聲。”', '《說文》：“悄，憂也。从心，肖聲。《詩》曰：‘憂心悄悄。’”', '《說文》：“漠，北方流沙也。一曰清也。从水，莫聲。”', '《說文》：“測，深所至也。从水，則聲。”', '《說文》：“汁，液也。从水，十聲。”', '《說文》：“拳，手也。从手，聲。”', '《說文》：“攜，提也。从手，巂聲。”', '《說文》：“授，予也。从手，从受，受亦聲。”', '《說文》：“挑，撓也。从手，兆聲。一曰摷也。《國語》曰：‘郤至挑夭。’”', '《說文》：“𢹎，煩也。从手，夒聲。”', '《說文》：“扣，牽馬也。从手，口聲。”', '《說文》：“𡝩，巧也。一曰女子笑皃。《詩》曰：‘桃之𡝩𡝩。’从女，芺聲。”', '《說文》：“匹，四丈也。从八、匸，八揲一匹，八亦聲。”', '《說文》：“繡，五采備也。从系，肅聲。”', '《說文》：“縫，以鍼紩衣也。从糸，逢聲。”', '《說文》：“龜，舊也，外骨內肉者也。从它，龜頭與它頭同，天地之性，廣肩無雄。龜鼈之類，以它為雄。象足、甲、尾之形。𠃾，古文龜。”', '《說文》：“毀，缺也。从土，毇省聲。𣪷，古文毀从壬。”', '《說文》：“畺，界也。从畕、三，其界畫也。疆，畺或从彊、土。”', '《說文》：“劣，弱也。从力，少聲。”', '《說文》：“𤖕，盬也。从肉，从酉。酒以和𤖕也。爿聲。𨟻，古文。𤖙，籀文。”', '《說文》：“哇，諂聲也。从口，圭聲。”', '《說文》：“舌，在口所以言也，別味也。从千，从口，千亦聲。”', '《說文》：“殊，死也。从歺，朱聲。漢令曰：‘蠻夷長有罪，當殊之。’”', '《說文》：“符，信也。漢制以竹，長六寸，分而相合。从竹，付聲。”', '《說文》：“甛，美也。从甘，从舌。舌，知甘者。”', '《說文》：“𩏇，履後帖也。从韋，段聲。緞，𩏇或从糸。”', '《說文》：“梯，木階也。从木，弟聲。”', '《說文》：“賴，贏也。从貝，剌聲。”', '《說文》：“𥁰，《周禮》曰：‘國有疑則盟。諸侯再相與會，十二歲一𥁰，北面詔天之司慎司命。𥁰，殺牲歃血，朱盤玉敦，以立牛耳。’从囧，从血。𥂗，篆文，从朙。盟，古文从明。”', '《說文》：“稾，稈也。从禾，高聲。”', '《說文》：“併，並也。从人，并聲。”', '《說文》：“償，還也。从人，賞聲。”', '《說文》：“裂，繒餘也。从衣，𠛱聲。”', '《說文》：“衰，艸雨衣。秦謂之萆。从衣象形。𠆂，古文衰。”', '《說文》：“歇，息也。一曰气越泄。从欠，曷聲。”', '《說文》：“頌，皃也。从頁，公聲。𩔜，籀文。”', '《說文》：“礙，止也。从石，疑聲。”', '《說文》：“驅，馬馳也。从馬，區聲。敺，古文驅从攴。”', '《說文》：“狡，少狗也。从犬，交聲。匈奴地有狡犬，巨口而黑身。”', '《說文》：“灌，水。出廬江雩婁，北入淮。从水，雚聲。”', '《說文》：“汙，薉也。一曰小池為汙。一曰涂也。从水，于聲。”', '《說文》：“擠，排也。从手，齊聲。”', '《說文》：“摘，拓果樹實也。从手，啻聲。”', '《說文》：“𢹬，抱也。从手，雝聲。”', '《說文》：“㛮，兄妻也。从女，叜聲。”', '《說文》：“匯，器也。从匚，淮聲。”', '《玉篇》：“𡍮，《說文》垂。”', '《說文新附》：“墾，耕也。从土，豤聲。”', '《說文》：“轟，羣車聲也。从三車。”', '《說文》：“阯，基也。从𨸏，止聲。址，阯或从土。”', '《說文》：“丙，位南方，萬物成炳然。陰气初起，陽气將虧，从一入冂。一者，陽也。丙承乙，象人肩。”', '《說文》：“萄，艸也。从艸，匋聲。”', '《說文》：“余，語之舒也。从八，舍省聲。𠎳，二余也，讀與余同。”', '《說文》：“犧，宗廟之牲也。从牛，羲聲。賈侍中說，此非古字。”', '《說文》：“吞，咽也。从口，天聲。”', '《說文》：“赴，趨也。从走，仆省聲。”', '《說文》：“遵，循也。从辵，尊聲。”', '《說文新附》：“齡，年也。从齒，令聲。”', '《說文》：“舒，伸也。从舍，从予，予亦聲。一曰：舒，緩也。”', '《說文》：“𦙪，髆也。从肉，象形。肩，俗肩从戶。”', '《說文》：“剝，裂也。从刀，从彔。彔，刻割也。彔亦聲。𠚩，剝或从卜。”', '《說文》：“柱，楹也。从木，主聲。”', '《說文》：“梁，水橋也。从木，从水，刅聲。渿，古文。”', '《說文》：“賈，賈市也。从貝，襾聲。一曰坐賣售也。”', '《說文》：“稀，疏也。从禾，希聲。”', '《說文》：“偶，桐人也。从人，禺聲。”', '《說文》：“羨，貪欲也。从㳄，从羑省。羑呼之羑，文王所拘羑里。”', '《說文》：“崇，嵬高也。从山，宗聲。”', '《說文》：“騰，傳也。从馬，朕聲。一曰：騰，犗馬也。”', '《說文》：“燭，庭燎，火燭也。从火，蜀聲。”', '《說文》：“契，大約也。从大，从㓞。《易》曰：‘後代聖人易之以書契。’”', '《說文》：“惑，亂也。从心，或聲。”', '《說文》：“滋，益也。从水，茲聲。一曰滋水，出牛飲山白陘谷，東入呼沱。”', '《說文》：“捨，釋也。从手，舍聲。”', '《說文》：“擬，度也。从手，疑聲。”', '《說文》：“撞，卂擣也。从手，童聲。”', '《說文》：“蝙，蝙蝠也。从虫，扁聲。”', '《說文》：“鍊，冶金也。从金，柬聲。”', '《說文》：“障，隔也。从𨸏，章聲。”', '《說文》：“陶，再成丘也。在濟陰。从𨸏，匋聲。《夏書》曰：‘東至于陶丘。’陶丘有堯城，堯嘗所居，故堯號陶唐氏。”', '《說文》：“辯，治也。从言在辡之間。”', '《說文》：“醻，主人進客也。从酉，𠷎聲。酬，醻或从州。”', '《說文》：“芽，萌芽也。从艸，牙聲。”', '《說文》：“拘，止也。从句，从手，句亦聲。”', '《說文》：“爪，𠃨也。覆手曰爪，象形。”', '《說文》：“焉，焉鳥，黃色，出於江淮。象形。”', '《說文》：“肌，肉也。从肉，几聲。”', '《說文》：“臘，冬至後三戌，臘祭百神。从肉，巤聲。”', '《說文》：“棧，棚也，竹木之車曰棧。从木，戔聲。”', '《說文》：“賓，所敬也。从貝，𡧍聲。𧶉，古文。”', '《說文》：“秩，積也。从禾，失聲。《詩》曰：‘積之秩秩。’”', '《說文》：“穴，土室也。从宀，八聲。”', '《說文》：“侍，承也。从人，寺聲。”', '《說文》：“伏，司也。从人，从犬。”', '《說文》：“徵，召也。从微省，壬為徵，行於微而文達者即徵之。𢾷，古文徵。”', '《說文》：“欽，欠皃。从欠，金聲。”', '《說文》：“庫，兵車藏也。从車，在广下。”', '《說文》：“𪋻，鹿行揚土也。从麤，从土。”', '《說文》：“爆，灼也。从火，暴聲。”', '《說文》：“竭，負舉也。从立，曷聲。”', '《說文》：“怨，恚也。从心，夗聲。𢘖，古文。”', '《說文》：“滴，水注也。从水，啻聲。”', '《說文》：“濃，露多也。从水，農聲。《詩》曰：‘零露濃濃。’”', '《說文》：“闊，疏也。从門，𣴠聲。”', '《說文》：“撫，安也。从手，無聲。一曰循也。𨑟，古文从辵、亡。”', '《說文新附》：“拋，棄也。从手，从尤〔尢〕，从力；或从手，𠠵聲。”', '《說文》：“姨，妻之女弟同出為姨。从女，夷聲。”', '《說文》：“弓，以近窮遠。象形。”', '《說文》：“纏，繞也。从糸，廛聲。”', '《說文》：“墓，丘也。从土，莫聲。”', '《說文新附》：“塔，西域浮屠也。从土，答聲。”', '《說文》：“劫，人欲去以力脅止曰劫。或曰：以力止去曰劫。”', '《說文》：“斜，杼也。从斗，余聲。”', '《說文》：“陪，重土也。一曰滿也。从𨸏，咅聲。”', '《說文》：“醉，卒也。卒其度量，不至於亂也。一曰潰也。从酉，从卒。”', '《說文》：“蒲，水艸也，可以作席。从艸，浦聲。”', '《說文》：“艾，冰臺也。从艸，乂聲。”', '《說文》：“距，雞距也。从足，巨聲。”', '《說文》：“廿，二十并也。古文省。”', '《說文新附》：“誌，記誌也。从言，志聲。”', '《說文》：“豎，豎立也。从臤，豆聲。豎，籀文豎从殳。”', '《說文》：“殿，擊聲也。从殳，𡱂聲。”', '《說文》：“爽，明也。从㸚，从大。𠁊，篆文爽。”', '《說文》：“嘉，美也。从壴，加聲。”', '《說文》：“株，木根也。从木，朱聲。”', '《說文》：“梳，理髮也。从木，疏省聲。”', '《說文》：“販，買賤賣貴者。从貝，反聲。”', '《說文新附》：“昂，舉也。从日，卬聲。”', '《說文》：“㚌，齊謂多為㚌，从多，果聲。”', '《說文》：“宅，所託也。从宀，乇聲。𡧪，古文宅。㡯，亦古文宅。”', '《說文》：“傲，倨也。从人，敖聲。”', '《說文》：“屍，終主。从尸，从死。”', '《說文》：“馳，大驅也。从馬，也聲。”', '《說文》：“驢，似馬，長耳。从馬，盧聲。”', '《說文》：“冤，屈也。从兔，从冖。兔在冖下不得走，益屈折也。”', '《說文》：“犬，狗之有縣蹏者也。象形。孔子曰：‘視犬之字如畫狗也。’”', '《說文》：“獄，确也。从㹜，从言。二犬，所以守也。”', '《說文》：“洛，水。出左馮翊歸德北夷界中，東南入渭。从水，各聲。”', '《說文》：“灑，汛也。从水，麗聲。”', '《說文》：“凍，仌也。从仌，東聲。”', '《說文》：“鮮，魚名，出貉國。从魚，羴省聲。”', '《說文》：“摩，研也。从手，麻聲。”', '《說文》：“𢶵，搰也。从手，屈聲。”', '《說文》：“繫，繫𦃇也。一曰惡絮。从糸，𣪠聲。”', '《說文》：“型，鑄器之法也。从土，刑聲。”', '《說文》：“艱，土難治也。从堇，艮聲。囏，籀文艱从喜。”', '《說文》：“輔，人頰車也。从車，甫聲。”', '《說文》：“隱，蔽也。从𨸏，㥯聲。”', '《說文》：“孟，長也。从子，皿聲。𣎼，古文孟。”', '《說文》：“震也。三月陽气動，雷電振，民農時也。物皆生。从乙、匕，象芒達，厂聲也。辰，房星，天時也。从二。二，古文上字。𠨷，古文辰。”', '《說文》：“菊，大菊，蘧麥。从艸，匊聲。”', '《說文》：“蔗，藷蔗也。从艸，庶聲。”', '《說文》：“芳，香艸也。从艸，方聲。”', '《說文》：“遞，更易也。从辵，虒聲。”', '《說文》：“衙，行皃。从行，吾聲。”', '《說文新附》：“詢，謀也。从言，旬聲。”', '《說文》：“竽，管三十六簧也。从竹，亏聲。”', '《說文》：“虐，殘也。从虍，虎足反爪人也。𧆱，古文虐如此。”', '《說文》：“饒，飽也。从食，堯聲。”', '《說文》：“厚，山陵之厚也。从㫗，从厂。垕，古文厚，从后、土。”', '《說文》：“枚，榦也，可為杖。从木，从攴。”', '《說文》：“購，以財有所求也。从貝，冓聲。”', '《說文》：“昭，日明也。从日，召聲。”', '《說文》：“秦，伯益之後所封國，地宜禾。从禾，舂省。一曰秦，禾名。𥠼，籀文秦从秝。”', '《說文》：“宏，屋深響也，从宀，厷聲。”', '《說文》：“弔，問終也。古之葬者，厚衣之以薪，从人持弓，會敺禽。”', '《說文》：“袍，襺也。从衣，包聲。《論語》曰：‘衣弊縕袍。’”', '《說文》：“駱，馬白色黑鬣尾也。从馬，各聲。”', '《說文》：“臭，禽走臭而知其迹者，犬也。从犬，从自。”', '《說文》：“憜，不敬也。从心，𡐦省。《春秋傳》曰：‘執玉憜。’惰，憜或省𨸏。媠，古文。”', '《說文》：“𢡆，悃也。从心，豤聲。”', '《說文》：“淋，以水𣵽也。从水，林聲。一曰淋淋，山下水皃。”', '《說文》：“𩙺，翄也。从飛，異聲。翼，篆文𩙺从羽。”', '《說文新附》：“閥，閥閱，自序也。从門，伐聲，義當通用伐。”', '《說文》：“綏，車中把也。从糸，从妥。”', '《說文》：“蠏，有二敖八足，旁行，非蛇鮮之穴無所態。从虫，解聲。”', '《說文》：“堪，地突也。从土，甚聲。”', '《說文》：“錫，銀鉛之間也。从金，易聲。”', '《說文》：“祥，福也。从示，羊聲。一云善。”', '《說文》：“瑞，以玉為信也。从玉、耑。”', '《說文》：“悉，詳盡也。从心，从釆。𢚊，古文悉。”', '《說文》：“咳，小兒笑也。从口，亥聲。孩，古文咳从子。”', '《說文》：“趨，走也。从走，芻聲。”', '《說文》：“跪，拜也。从足，危聲。”', '《說文》：“誓，約束也。从言，折聲。”', '《說文》：“卑，賤也，執事也。从𠂇、甲。”', '《說文》：“敦，怒也，詆也。一曰誰何也。从攴，𦎧聲。”', '《說文》：“盼，《詩》曰：‘美目盼兮。’从目，分聲。”', '《說文》：“肺，金藏也。从肉，巿聲。”', '《說文》：“晏，天清也。从日，安聲。”', '《說文》：“棗，羊棗也。从重朿。”', '《說文》：“𪏯，履黏也。从黍，𥝢省聲。𥝢，古文利。作履黏以黍米。”', '《說文》：“屆，行不便也。一曰極也。从尸，凷聲。”', '《說文新附》：“廈，屋也。从广，夏聲。”', '《說文》：“𤓪，火所傷也。从火，雥聲。𤊙，或省。”', '《說文》：“慨，忼慨，壯士不得志也。从心，既聲。”', '《說文》：“怠，慢也。从心，台聲。”', '《說文新附》：“惹，亂也。从心，若聲。”', '《說文》：“漂，浮也。从水，票聲。”', '《說文》：“溝，水瀆，廣四尺，深四尺。从水，冓聲。”', '《說文》：“澳，隈厓也。其內曰澳，其外曰隈。从水，奧聲。”', '《說文》：“婢，女之卑者也。从女，从卑，卑亦聲。”', '《說文》：“縛，束也。从糸，尃聲。”', '《說文》：“紐，系也。一曰結而可解。从糸，丑聲。”', '《說文》：“蝦，蝦蟆也。从虫，叚聲。”', '《說文》：“坡，阪也。从土，皮聲。”', '《說文》：“填，塞也。从土，真聲。”', '《說文》：“坦，安也。从土，旦聲。”', '《說文》：“畮，六尺為步，步百為畮。从田，每聲。𤱑，畮或从田、十、久。”', '《說文》：“陵，大𨸏也。从𨸏，夌聲。”', '《說文》：“丑，紐也。十二月，萬物動，用事。象手之形。時加丑，亦舉手時也。”', '《說文》：“蓬，蒿也。从艸，逢聲。莑，籀文蓬省。”', '《說文》：“鳳，神鳥也。天老曰：鳳之象也，鴻前麐後，蛇頸魚尾，鸛顙鴛思，龍文虎背，燕頷雞喙，五色備舉。出於東方君子之國，翺翔四海之外，過崐崘，飲砥柱，濯羽弱水，莫宿風穴，見則天下大安寧。从鳥，凡聲。𠤈，古文鳳，象形。鳳飛羣鳥從以萬數，故以為朋黨字。𪆍，亦古文鳳。”', '《說文》：“胎，婦孕三月也。从肉，台聲。”', '《說文》：“筋，肉之力也。从力，从肉，从竹。竹，物之多筋者。”', '《說文》：“券，契也。从刀，聲。券別之書，以刀判契其旁，故曰契券。”', '《說文》：“饕，貪也。从食，號聲。叨，饕或从口，刀聲。號，籀文饕从號省。”', '《說文》：“暇，閑也。从日，叚聲。”', '《說文》：“凶，惡也。象地穿交陷其中也。”', '《說文》：“奧，宛也。室之西南隅。从宀，𢍏聲。”', '《說文》：“儀，度也。从人，義聲。”', '《說文》：“裕，衣物饒也。从衣，谷声。《易》曰：‘有孚裕無咎。’”', '《說文新附》：“衫，衣也。从衣，彡聲。”', '《說文》：“舟，船也。古者共鼓、貨狄刳木為舟，剡木為楫，以濟不通。象形。”', '《說文》：“頸，頭莖也。从頁，巠聲。”', '《說文》：“魂，陽氣也。从鬼，云聲。”', '《說文》：“靖，立竫也。从立，青聲。一曰細皃。”', '《說文》：“憤，懣也。从心，賁聲。”', '《說文》：“潭，水。出武陵鐔成玉山，東入鬱林。从水，覃聲。”', '《說文》：“嫌，不平於心也。一曰疑也。从女，兼聲。”', '《說文新附》：“嬌，姿也。从女，喬聲。”', '《說文》：“彎，持弓關矢也。从弓，䜌聲。”', '《說文》：“壤，柔土也。从土，襄聲。”', '《說文》：“堤，滯也。从土，是聲。”', '《說文》：“壘，軍壁也。从土，畾聲。”', '《說文》：“輯，車和輯也。从車，咠聲。”', '《說文》：“軌，車徹也。从車，九聲。”', '《說文》：“菲，芴也。从艸，非聲。”', '《說文》：“哉，言之閒也。从口，𢦒聲。”', '《說文》：“疋，足也。上象腓腸，下从止。《弟子職》曰：‘問疋何止﹖’古文以為《詩．大疋》字，亦以為足字，或曰胥字。一曰疋記也。”', '《說文》：“諾，𧭭也。从言，若聲。”', '《說文》：“曼，引也。从又，冒聲。”', '《說文》：“鴿，鳩屬。从鳥，合聲。”', '《說文》：“胃，穀府也。从肉、。象形。”', '《說文》：“腸，大小腸也。从肉，昜聲。”', '《說文》：“膀，脅也。从肉，㫄聲。髈，膀或从骨。”', '《說文》：𣍘，獄之兩曹也。在廷東，从㯥，治事者，从曰。”', '《說文》：“稟，賜穀也。从㐭，从禾。”', '《說文》：“棊，博棊。从木，其聲。”', '《說文新附》：“樁，橛杙也。从木，舂聲。”', '《說文》：“邦，國也。从邑，丰聲。𤰫，古文。”', '《說文》：“邱，地名。从邑，丘聲。”', '《說文》：“宰，辠人在屋下執事者。从宀，从辛。辛，辠也。”', '《說文》：“幅，布帛廣也。从巾，畐聲。”', '《說文》：“佳，善也。从人，圭聲。”', '《說文》：“伶，弄也。从人，令聲。益州有建伶縣。”', '《說文》：“㔬，高也。早匕為㔬，匕卪為卬，皆同義。卓，古文㔬。”', '《說文》：“衷，裏褻衣。从衣，中聲。《春秋傳》曰：‘皆衷其衵服。’”', '《說文》：“履，足所依也。从尸，从彳，从攵，舟象履形。一曰尸聲。𩕎，古文履从頁，从足。”', '《說文》：“欣，笑喜也。从欠，斤聲。”', '《說文》：“恢，大也。从心，灰聲。”', '《說文》：“愉，薄也。从心，俞聲。《論語》曰：‘私覿愉愉如也。’”', '《說文》：“渾，混流聲也。从水，軍聲。一曰洿下皃。”', '《說文》：“𤖅，酢𤖅也。从水，將省聲。𤕯，古文𤖅省。”', '《說文》：“涕，泣也。从水，弟聲。”', '《說文》：“抗，扞也。从手，亢聲。杭，抗或从木。”', '《說文》：“繪，會五采繡也。《虞書》曰：‘山龍華蟲作繪。’《論語》曰：‘繪事後素。’从糸，會聲。”', '《說文》：“徽，衺幅也。一曰三糾繩也。从糸，微省聲。”', '《說文》：“鍾，酒器也。从金，重聲。”', '《說文》：“轄，車聲也。从車，害聲。一曰轄，鍵也。”', '《說文》：“陝，弘農陝也，古虢國王季之子所封也。从𨸏，㚒聲。”', '《說文》：“藍，染青草也。从艸，監聲。”', '《說文》：“菩，艸也。从艸，咅聲。”', '《說文》：“莖，枝柱也。从艸，巠聲。”', '《說文》：“蔡，艸也。从艸，祭聲。”', '《說文》：“噴，吒也。从口，賁聲。一曰鼓鼻。”', '《說文》：“糾，繩三合也。从糸、丩。”', '《說文》：“諜，軍中反閒也。从言，枼聲。”', '《說文》：“寺，廷也，有法度者也。从寸，之聲。”', '《說文》：“甫，男子美稱也。从用、父，父亦聲。”', '《說文》：“翠，青羽雀也，出鬱林。从羽，卒聲。”', '《說文》：“梅，枏也，可食。从木，每聲。楳，或从某。”', '《說文》：“杜，甘棠也。从木，土聲。”', '《說文》：“柯，斧柄也。从木，可聲。”', '《說文》：“賤，賈少也。从貝，戔聲。”', '《說文》：“宇，屋邊也。从宀，于聲。《易》曰：‘上棟下宇’。㝢，籀文宇从禹。”', '《說文》：“疲，勞也。从疒，皮聲。”', '《說文》：“傑，傲也。从人，桀聲。”', '《說文》：“后，繼體君也。象人之形。施令以告四方，故厂之，从一、口。發號者，君后也。”', '《說文》：“嶽，東岱、南靃、西華、北恒、中泰室，王者之所以巡狩所至。从山，獄聲。岳，古文象高形。”', '《說文》：“獘，頓仆也。从犬，敝聲。《春秋傳》曰：‘與犬犬獘’。斃，獘或从死。”', '《說文》：“溜，水。出鬱林群。从水，留聲。”', '《說文》：“淮，水。出南陽平氏桐柏大復山，東南入海。从水，隹聲。”', '《說文》：“泡，水。出山陽平樂，東北入泗。从水，包聲。”', '《說文》：“沖，涌搖也。从水、中。讀若動。”', '《說文》：“浦，瀕也。从水，甫聲。”', '《說文》：“瀋，汁也。从水，審聲。《春秋傳》：‘猶拾瀋。’”', '《說文》：“控，引也。从手，空聲。《詩》曰：‘控于大邦。’匈奴名引弓控弦。”', '《說文》：“媒，謀也，謀合二姓。从女，某聲。”', '《說文》：“姿，態也。从女，次聲。”', '《說文》：“緬，微絲也。从糸，面聲。”', '《說文》：“紡，網絲也。从糸，方聲。”', '《說文》：“鑿，穿木也。从金。𥽿省聲。”', '《說文》：“禹，蟲也。从厹，象形。𥜼，古文禹。”', '《說文》：“𡵳，艸初生，其香分布。从屮，从分，分亦聲。芬，𡵳或从艸。”', '《說文》：“蓮，芙蕖之實也。从艸，連聲。”', '《說文》：“踐，履也。从足，戔聲。”', '《說文》：“翄，翼也。从羽，支聲。𦐊，翄或从氏。”', '《說文》：“雁，鳥也。从隹，从人，厂聲。讀若鴈。”', '《說文》：“膜，肉間胲膜也。从肉，莫聲。”', '《說文》：“劑，齊也。从刀，从齊，齊亦聲。”', '《說文》：“竿，竹梃也。从竹，干聲。”', '《說文》：“盧，飲器也。从皿，𧇄聲。𥃈，籀文盧。”', '《說文》：“缸，瓨也。从缶，工聲。”', '《說文》：“郊，距國百里為郊。从邑，交聲。”', '《說文》：“昆，同也。从日，从比。”', '《說文新附》：“映，明也，隱也。从日，央聲。”', '《說文》：“晶，精光也。从三日。”', '《說文》：“朗，明也。从月，良聲。”', '《說文》：“黏，相箸也。从黍，占聲。”', '《說文》：“𤻲，治也。从疒，樂聲。療或从尞。”', '《說文》：“傭，均，直也。从人，庸聲。”', '《說文》：“億，安也。从人，意聲。”', '《說文》：“襲，左衽袍。从衣，龖省聲。𧟟，籀文襲不省。”', '《說文》：“屏，敝也。从尸，并聲。”', '《說文》：“頁，頭也。从𦣻，从儿。古文䭫如此。𦣻者䭫首字也。”', '《說文》：“卿，章也。六卿：天官冢宰，地官司徒，春官宗伯，夏官司馬，秋官司寇，冬官司空。从卯，皀聲。”', '《說文》：“峯，山耑也。从山，夆聲。”', '《說文》：“厲，旱石也。从厂，蠆省聲。𧓽，或不省。”', '《說文》：“炎，火光上也。从重火。”', '《說文》：“淑，清湛也。从水，叔聲。”', '《說文》：“攝，引持也。从手，聶聲。”', '《說文》：“紫，帛青赤色。从糸，此聲。”', '《說文》：“恆，常也。从心，从舟，在二之閒上下，心以舟施恆也。𠄨，古文恆从月。《詩》曰：‘如月之恆。’”', '《說文新附》：“塘，隄也。从土，唐聲。”', '《說文》：“錘，八銖也。从金，垂聲。”', '《說文》：“軸，持輪也。从車，由聲。”', '《說文》：“疏，通也。从㐬，从疋，疋亦聲。”', '《說文》：“碧，石之青美者。从玉、石，白聲。”', '《說文新附》：“蔬，菜也。从艸，疏聲。”', '《說文》：“葬，藏也。从死在茻中。一其中，所以薦之。《易》曰：‘古之葬者，厚衣之以薪。’”', '《說文》：“胖，半體肉也。一曰廣肉。从半，从肉，半亦聲。”', '《說文》：“逝，往也。从辵，折聲。讀若誓。”', '《說文》：“誕，詞誕也。从言，延聲。𧥡，籀文省。”', '《說文》：“靃，飛聲也，雨而雙飛者其聲靃然。”', '《說文》：“械，桎梏也。从木，戒聲。一曰器之緫名。一曰持也。一曰有盛為械，無盛為器。”', '《說文》：“桑，蠶所食葉木。从叒、木。”', '《說文》：“霸，月始生霸然也，承大月二日，承小月三日。从月，䨣聲。《周書》曰：‘哉生霸。’𣍸，古文霸。”', '《說文》：“伍，相參伍也。从人，从五。”', '《說文》：“丘，土之高也，非人所為也。从北，从一。一，地也。人居在丘南，故从北。中邦之居在崐崘東南。一曰四方高中央下為丘。象形。㘳，古文从土。”', '《說文》：“袁，長衣皃。从衣，叀省聲。”', '《說文新附》：“魔，鬼也。从鬼，麻聲。”', '《說文》：“赫，火赤皃。从二赤。”', '《說文》：“湘，水。出零陵陽海山，北入江。从水，相聲。”', '《說文》：“𡫏，水。出魏郡武安，東北入呼沱水。从水，𡩠聲；𡩠，籀文𡪢字。”', '《說文》：“溶，水盛也。从水，容聲。”', '《說文》：“澤，光潤也。从水，睪聲。”', '《說文》：“渠，水所居。从水，榘省聲。”', '《說文》：“渴，盡也。从水，曷聲。”', '《說文》：“澡，洒手也。从水，喿聲。”', '《說文》：“揭，高舉也。从手，曷聲。”', '《說文》：“扔，因也。从手，乃聲。”', '《說文》：“𦅾，生絲縷也。从糸，敫聲。”', '《說文》：“蝗，螽也。从虫，皇聲。”', '《說文》：“甸，天子五百里地。从田，包省。”', '《說文》：“鍛，小冶也。从金，段聲。”', '《說文》：“鋸，槍唐也。从金，居聲。”', '《說文》：“祭，祭祀也。从示，以手持肉。”', '《說文新附》：“遙，逍遙也。又遠也。从辵，䍃聲。”', '《說文》：“晝，日之出入，與夜為界。从畫省，从日。𦘘，籀文晝。”', '《說文》：“寇，暴也。从攴，完。”', '《說文》：“翔，回飛也。从羽，羊聲。”', '《說文》：“笨，竹裏也。从竹，本聲。”', '《說文》：“郭，齊之郭氏虛。善善不能進，惡惡不能退，是以亡國也。从邑，𩫏聲。”', '《說文》：“𨞠，里中道。䢽，篆文。”', '《說文》：“秒，禾芒也。从禾，少聲。”', '《說文》：“疫，民皆疾也。从疒，役省聲。”', '《說文》：“仲，中也。从人，从中，中亦聲。”', '《說文》：“側，旁也。从人，則聲。”', '《說文》：“屠，刳也。从尸，者聲。”', '《說文新附》：“礎，礩也。从石，楚聲。”', '《說文》：“𩫚，豕，鬣如筆管者，出南郡。从㣇，高聲。𩫕，籀文从豕。”', '《說文》：“煉，鑠治金也。从火，柬聲。”', '《說文》：“黴，中久雨青黑。从黑，微省聲。”', '《說文》：“喬，高而曲也。从夭，从高省。《詩》曰：‘南有喬木。’”', '《說文》：“慧，儇也。从心，彗聲。”', '《說文》：“沈，陵上滈水也。从水，冘聲。一曰濁黕也。”', '《說文》：“冰，水堅也。从仌，从水。凝，俗冰从疑。”', '《說文》：“𢯱，眾意也。一曰求也。从手，叜聲。”', '《說文》：“脊，背呂也。从𠦬，从肉。”', '《說文》：“娃，圜深目皃。或曰，吳楚之間謂好曰娃。从女，圭聲。”', '《說文新附》：“娟，嬋娟也。从女，肙聲。”', '《說文》：“閩，東南越。蛇穜。从虫，門聲。”', '《說文》：“堯，高也。从垚在兀上，高遠也。𡋰，古文堯。”', '《說文》：“勃，排也。从力，孛聲。”', '《說文》：“鏠，兵耑也。从金，逢聲。”', '《說文》：“醋，客酌主人也。从酉，昔聲。”', '《說文》：“芝，神艸也。从艸，从之。”', '《說文》：“蕉，生枲也。从艸，焦聲。”', '《說文》：“萊，蔓華也。从艸，來聲。”', '《說文》：“啞，笑也。从口，亞聲。”', '《說文》：“咸，皆也，悉也。从口，从戌。戌，悉也。”', '《說文》：“叢，聚也。从丵，取聲。”', '《說文》：“毅，妄怒也。一曰有決也。从殳，豙聲。”', '《說文》：“敏，疾也。从攴，每聲。”', '《說文新附》：“腔，內空也。从肉、从空，空亦聲。”', '《說文》：“削，鞞也。一曰析也。从刀，肖聲。”', '《說文》：“𠛬，剄也。仌刀，幵聲。”', '《說文》：“衡，牛觸，橫大木其角。从角，从大，行聲。《詩》曰：‘設其楅衡。’𡘻，古文衡如此。”', '《說文》：“倉，穀藏也，倉黃取而藏之，故謂之倉。从食省，口象倉形。仺，奇字倉。”', '《說文新附》：“罐，器也。从缶，雚聲。”', '《說文》：“桶，木方，受六升。从木，甬聲。”', '《說文》：“巢，鳥在木上曰巢，在穴曰窠。从木，象形。”', '《說文》：“贛，賜也。从貝，贛省聲。”', '《說文》：“貿，易財也。从貝，丣聲。”', '《說文》：“旦，明也。从日見一上。一，地也。”', '《說文》：“秧，禾若秧穰也。从禾，央聲。”', '《說文》：“宴，安也。从宀，晏聲。”', '《說文》：“窯，燒瓦竈也。从穴，羔聲。”', '《說文》：“罩，捕魚器也。从网，卓聲。”', '《說文》：“倦，罷也。从人，卷聲。”', '《說文新附》：“霞，赤雲气也。从雨，叚聲。”', '《說文》：“捲，气勢也。从手，卷聲。《國語》曰：‘有捲勇。’一曰捲收也。”', '《說文》：“捷，獵也，軍獲得也。从手，疌聲。《春秋傳》曰：‘齊人來獻戎捷。’”', '《說文》：“娥，帝堯之女，舜妻。娥皇，字也。秦晉謂好曰娙娥。从女，我聲。”', '《說文》：“纖，細也。从糸，韱聲。”', '《說文》：“絡，絮也。一曰麻未漚也。从糸，各聲。”', '《說文》：“禽，走獸總名。从𠘯，象形，今聲。禽、离、兕，頭相似。”', '《說文》：“蘿，莪也。从艸，羅聲。”', '《說文》：“芒，艸耑。从艸，亾聲。”', '《說文》：“茂，艸豐盛。从艸，戊聲。”', '《說文》：“哲，知也。从口，折聲。悊，哲或从心。嚞，古文哲从三吉。”', '《說文》：“邁，遠行也。从辵，蠆省聲。𨙚，邁或不省。”', '《說文》：“訥，言難也。从言，从內。”', '《說文》：“鞭，驅也。从革，便聲。𠓥，古文鞭。”', '《說文》：“𦐧，羽之𦐧風。亦古諸侯也。一曰射師。从羽，幵聲。”', '《說文》：“糞，棄除也。从廾推𠦒糞采也。官溥說：似米而非米者，矢字。”', '《說文》：“玄，幽遠也。黑而有赤色者為玄。象幽而入覆之也。𢆯，古文玄。”', '《說文》：“脂，戴角者脂，無角者膏。从肉，旨聲。”', '《說文》：“矦，春饗所䠶矦也。从人，从厂，象張布，矢在其下。”', '《說文》：“䑞，艸也。楚謂之葍，秦謂之藑。蔓地連華。象形。从舛，舛亦聲。𡐩，古文䑞。”', '《說文》：“棃，果名。从木，𥝢聲。𥝢，古文利。”', '《說文》：“桐，榮也。从木，同聲。”', '《說文》：“枯，槀也。从木，古聲。《夏書》曰‘唯箘輅枯’。木名也。”', '《說文》：“祁，太原縣。从邑，示聲。”', '《說文》：“傍，近也。从人，旁聲。”', '《說文新附》：“偵，問也。从人，貞聲。”', '《說文》：“燥，乾也。从火，喿聲。”', '《說文》：“黔，黎也。从黑，今聲。秦謂民為黔首，謂黑色也。周謂之黎民。《易》曰：‘為黔喙。’”', '《說文》：“浩，澆也。从水，告聲。《虞書》曰：‘洪水浩浩。’”', '《說文》：“淵，回水也。从水，象形，左右岸也，中象水皃。𣶒，淵或省水。囦，古文从囗、水。”', '《說文》：“𤅩，水濡而乾也。从水，𪄿聲。《詩》曰：‘𤅩其乾矣。’灘，俗𤅩从隹。”', '《說文新附》：“瓷，瓦器。从瓦，次聲。”', '《說文》：“鼄，䵹鼄也。从黽，朱聲。蛛，鼄或从虫。”', '《說文新附》：“塾，門側堂也。从土，孰聲。”', '《說文》：“釣，鉤魚也。从金，勺聲。”', '《說文》：“斧，斫也。从斤，父聲。”', '《說文》：“隴，天水大阪也。从𨸏，龍聲。”', '《說文》：“蘆，蘆菔也。一曰薺根。从艸，盧聲。”', '《說文》：“喉，咽也。从口，侯聲。”', '《說文》：“噍，齧也。从口，焦聲。嚼，噍或从爵。”', '《說文》：“迅，疾也。从辵，卂聲。”', '《說文》：“逮，唐逮，及也。从辵，隶聲。”', '《說文》：“循，行順也。从彳，盾聲。”', '《說文》：“脅，兩𦜶也。从肉，劦聲。”', '《說文》：“胑，體四胑也。从肉，只聲。肢，胑或从支。”', '《說文》：“刮，掊把也。从刀，𠯑聲。”', '《說文》：“樸，木素也。从木，菐聲。”', '《說文》：“夕，莫也。从月半見。”', '《說文》：“㮚，木也。从木，其實下垂，故从𠧪。𣡷，古文㮚从西、从二𠧪。徐巡說。木至西方戰㮚。”', '《說文》：“穫，刈穀也。从禾，蒦聲。”', '《說文》：“帚，糞也。从又持巾埽冂內。”', '《說文》：“彰，文彰也。从彡，从章，章亦聲。”', '《說文新附》：“崙，崑崙也。从山，侖聲。”', '《說文》：“夷，平也。从大，从弓。東方之人也。”', '《說文》：“悑，惶也。从心，甫聲。怖，或从布聲。”', '《說文》：“淹，水。出越巂徼外，東入若水。从水，奄聲。”', '《說文》：“溉，水。出東海桑瀆覆甑山，東北入海。一曰灌注也。从水，既聲。”', '《說文》：“淪，小波為淪。从水，侖聲。《詩》曰：‘河水清且淪漪。’一曰沒也。”', '《說文》：“潘，淅米汁也。一曰水名，在河南滎陽。从水，番聲。”', '《說文》：“澆，𣵽也。从水，堯聲。”', '《說文》：“霜，喪也，成物者。从雨，相聲。”', '《說文》：“挨，擊背也。从手，矣聲。”', '《說文》：“蛟，龍之屬也。池魚滿三千六百，蛟來為之長，能率魚飛。置笱水中，即蛟去。从虫，交聲。”', '《說文》：“䵹，䵹鼄，蟊也。从黽，𣉻省聲。𧐉，或从虫。”', '《說文》：“埃，塵也。从土，矣聲。”', '《說文》：“馗，九達道也。似龜背，故謂之馗。馗，高也。从九从首。逵，馗或从辵从坴。”', '《說文》：“玲，玉聲。从玉，令聲。”', '《說文》：“茅，菅也。从艸，矛聲。”', '《說文》：“范，艸也。从艸，氾聲。”', '《說文》：“喔，雞聲也。从口，屋聲。”', '《說文》：“跨，渡也。从足，夸聲。”', '《說文》：“鉤，曲也。从金，从句，句亦聲。”', '《說文》：“徹，通也。从彳，从攴，从育。𢖉，古文徹。”', '《說文》：“鴻，鴻鵠也。从鳥，江聲。”', '《說文》：“鶯，鳥也。从鳥，榮省聲。《詩》曰：‘有鶯其羽。’”', '《說文》：“幽，隱也。从山，中𢆶，𢆶亦聲。”', '《說文》：“骼，禽獸之骨曰骼。从骨，合聲。”', '《說文》：“胳，亦下也。从肉，各聲。”', '《說文》：“巫，祝也。女能事無形，以舞降神者也。象人兩褎舞形，與工同意。古者巫咸初作巫。𢍮，古文巫。”', '《說文》：“榜，所以輔弓弩。从木，旁聲。”', '《說文》：“糟，酒滓也。从米，曹聲。𨣹，籀文从酉。”', '《說文》：“例，比也。从人，𠛱聲。”', '《說文》：“俘，軍所獲也。从人，孚聲。”', '《說文》：“㞕，動作切切也。从尸，䏌聲。”', '《說文》：“頒，大頭也。从頁，分聲。一曰鬢也。《詩》曰：有頒其首。’”', '《說文》：“醜，可惡也。从鬼，酉聲。”', '《說文新附》：“廊，東西序也。从广，郎聲。”', '《說文》：“懲，㣻也。从心，徵聲。”', '《說文》：“潰，漏也。从水，貴聲。”', '《說文》：“泳，潛行水中也。从水，永聲。”', '《說文》：“披，从旁持曰披。从手，皮聲。”', '《說文》：“拓，拾也。陳、宋語。从手，石聲。摭，拓或从庶。”', '《說文新附》：“攤，開也。从手，難聲。”', '《說文》：“娛，樂也。从女，吳聲。”', '《說文》：“嬰，頸飾也。从女、賏，賏，其連也。”', '《說文》：“誼，人所宜也。从言，从宜，宜亦聲。”', '《說文》：“診，視也。从言，㐱聲。”', '《說文新附》：“韻，和也。从音，員聲。裴光遠云：‘古與均同。’未知其審。”', '《說文》：“橘，果，出江南。从木，矞聲。”', '《說文》：“樞，戶樞也。从木，區聲。”', '《說文》：“析，破木也。一曰折也。从木，从斤。”', '《說文》：“稽，留止也。从𥝌，从尤，旨聲。”', '《說文》：“郡，周制，天子地方千里，分為百縣，縣有四郡。故《春秋傳》曰：‘上大夫受郡’是也。至秦初，置三十六郡以監其縣。从邑，君聲。”', '《說文》：“鄂，江夏縣。从邑，㖾聲。”', '《說文》：“鄱，鄱陽，豫章縣。从邑，番聲。”', '《說文新附》：“昇，日上也。从日，升聲。古只用升。”', '《說文》：“份，文質僣也。从人，分聲。《論語》曰：‘文質份份。’彬，古文份从彡、林。林者，从焚省聲。”', '《說文》：“仿，相似也。从人，方聲。㑂，籀文仿从丙。”', '《說文》：“儉，約也。从人，僉聲。”', '《說文》：“廁，清也。从广，則聲。”', '《說文》：“忌，憎惡也。从心，己聲。”', '《說文》：“汝，水。出弘農盧氏還歸山，東入淮。从水，女聲。”', '《說文》：“汕，魚游水皃。从水，山聲。《詩》曰：‘蒸然汕汕’。”', '《說文》：“潤，水曰潤下。从水，閏聲。”', '《說文》：“鹹，銜也。北方味也。从鹵，咸聲。”', '《說文》：“措，置也。从手，昔聲。”', '《說文》：“繭，蠶衣也。从系，从虫，黹省。絸，古文繭，从系、見。”', '《說文》：“蠻，南蠻，蛇穜。从虫，䜌聲。”', '《說文》：“鏈，銅屬。从金，連聲。”', '《說文》：“𨹟，阨陜也。”', '《說文》：“禦，祀也。从示，御聲。”', '《說文》：“瓊，赤玉也。从玉，敻聲。璚，瓊或从矞。瓗，瓊或从巂。琁，瓊或从旋省。”', '《說文》：“蕭，艾蒿也。从艸，肅聲。”', '《說文》：“徧，帀也。从彳，扁聲。”', '《說文》：“躍，迅也。从足，翟聲。”', '《說文》：“肝，木藏也。从肉，干聲。”', '《說文》：“籤，驗也。一曰銳也，貫也。从竹，韱聲。”', '《說文》：“亭，民所安定也。亭有樓，从高省，丁聲。”', '《說文》：“楹，柱也。从木，盈聲。《春秋傳》曰：‘丹桓宮楹。’”', '《說文》：“柄，柯也。从木，丙聲。棅，或从秉。”', '《說文》：“疥，搔也。从疒，介聲。”', '《說文》：“倭，順皃。从人，委聲。《詩》曰：‘周道倭遲。’”', '《說文》：“勻，少也。从勹、二。”', '《說文》：“𦍶，相訹呼也。从厶，从羑。誘，或从言、秀。䛻或如此。羑，古文。”', '《說文新附》：“崑，崑崙，山名。从山，昆聲。”', '《說文》：“狄，赤狄，本犬種。狄之為言淫辟也。从犬，亦省聲。”', '《說文新附》：“燦，燦爤，明瀞皃。从火，粲聲。”', '《說文》：“泌，俠流也。从水，必聲。”', '《說文》：“侃，剛直也。从㐰，㐰，古文信；从川，取其不舍晝夜。《論語》曰：‘子路侃侃如也。’”', '《說文》：“耽，耳大垂也。从耳，冘聲。《詩》曰：‘士之耽兮’。”', '《說文》：“扮，握也。从手，分聲。讀若粉。”', '《說文》：“挺，拔也。从手，廷聲。”', '《說文》：“姪，兄之女也。从女，至聲。”', '《說文》：“瑟，庖犧所作弦樂也。从珡，必聲。”', '《說文》：“綱，維紘繩也。从糸，岡聲。㭃，古文綱。”', '《說文》：“垣，牆也。从土，亘聲。𩫧，籀文垣从𩫏。”', '《說文》：“勁，彊也。从力，巠聲。”', '《說文》：“募，廣求也。从力，莫聲。”', '《說文新附》：“鎖，鐵鎖，門鍵也。从金，𧴪聲。”', '《說文》：“隙，壁際孔也。从𨸏，从𡭴，𡭴亦聲。”', '《說文》：“禱，告事求福也。从示，壽聲。𥛈，禱或省。𥜱，籀文禱。”', '《說文》：“屯，難也。象艸木之初生，屯然而難。从中貫一，一，地也。尾曲。《易》曰：‘屯，剛柔始交而難生’。”', '《說文》：“詹，多言也。从言，从八，从厃。”', '《說文》：“咨，謀事曰咨。从口，次聲。”', '《說文》：“蹲，踞也。从足，尊聲。”', '《說文》：“笛，七孔筩也。从竹，由聲。羌笛三孔。”', '《說文》：“彭，鼓聲也。从壴，彡聲。”', '《說文》：“采，捋取也。从木，从爪。”', '《說文》：“贏，有餘賈利也。从貝，𦝠聲。”', '《說文新附》：“僧，浮屠道人也。从人，曾聲。”', '《說文》：“歉，歉食不滿。从欠，兼聲。”', '《說文》：“顚，頂也。从頁，眞聲。”', '《說文》：“𥸤，呼也。从頁，籥聲，讀與籥同。《商書》曰：‘率𥸤眾戚。’”', '《說文》：“騫，馬腹縶也。从馬，寒省聲。”', '《說文》：“掩，斂也，小上曰掩。从手，奄聲。”', '《說文》：“弦，弓弦也，从弓，象絲軫之形。”', '《說文》：“綜，機縷也。从糸，宗聲。”', '《說文》：“虹，螮蝀也。狀似蟲。从虫，工聲。《明堂》、《月令》曰：‘虹始見。’”', '《說文》：“墳，墓也。从土，賁聲。”', '《說文》：“勳，能成王功也。从力，熏聲。勛，古文勳从員。”', '《說文》：“銼，鍑也。从金，坐聲。”', '《說文》：“羞，進獻也。从羊，羊所進也；从丑，丑亦聲。”', '《說文》：“釀，醞也，作酒曰釀。从酉，襄聲。”', '《說文》：“蕪，薉也。从艸，無聲。”', '《說文》：“唯，諾也。从口，隹聲。”', '《說文》：“唸㕧也。从口，念聲。《詩》曰：‘民之方唸㕧。’”', '《說文》：“訟，爭也。从言，公聲。曰謌訟。䛦，古文訟。”', '《說文》：“𦮃，戾也。从𦫳而兆；兆，古文別。”', '《說文》：“腎，水藏也。从肉，臤聲。”', '《說文》：“膊，薄脯，膊之屋上。从肉，尃聲。”', '《說文》：“劈，破也。从刀，辟聲。”', '《說文》：“箕，簸也。从竹；𠀠，象形；下其丌也。𠀠，古文箕省。𠔛，亦古文箕。𠔋，亦古文箕。，籀文箕。𠥊，籀文箕。”', '《說文》：“榆，白枌。从木，俞聲。”', '《說文》：“虜，獲也。从毌，从力，虍聲。”', '《說文》：“襄，漢令：解衣耕謂之襄。从衣，𤕦聲。𡣿，古文襄。”', '《說文》：“𡹔，山壞也。”', '《說文》：“逸，失也。从辵、兔。兔謾訑善逃也。”', '《說文》：“懼，恐也。从心，瞿聲。愳，古文。”', '《說文》：“悠，憂也。从心，攸聲。”', '《說文》：“萍，苹也，水艸也。从水、苹，苹亦聲。”', '《說文》：“聘，訪也。从耳，甹聲。”', '《說文》：“𢕈，生而聾曰聳。从耳，從省聲。”', '《說文》：“攪，亂也。从手，覺聲。《詩》曰：‘祇攪我心。’”', '《說文》：“奸，犯婬也。从女，从干，干亦聲。”', '《說文》：“蜀，葵中蠶也。从虫。上目象蜀頭形，中象其身蜎蜎。《詩》曰：‘蜎蜎者蜀。’”', '《說文》：“蚌，蜃屬。从虫，丰聲。”', '《說文》：“銜，馬勒口中。从金，从行。銜，行馬者也。”', '《說文新附》：“銘，記也。从金，名聲。”'];
